                values: new object[,]
                {
                    { "CATE001", "Khám phá các bãi biển tuyệt đẹp, tận hưởng nắng vàng và sóng biển, tham gia thể thao dưới nước. Phù hợp cho gia đình, cặp đôi hoặc những ai muốn thư giãn.", "Du lịch biển" },
                    { "CATE002", "Trải nghiệm di sản văn hóa phong phú, tham quan đền chùa, bảo tàng, tìm hiểu phong tục tập quán địa phương. Lý tưởng cho người yêu lịch sử và nghệ thuật.", "Du lịch văn hóa" },
                    { "CATE003", "Dành cho những người thích thử thách và khám phá. Tham gia các hoạt động mạo hiểm như leo núi, trekking, chèo thuyền kayak, zipline trong môi trường tự nhiên.", "Du lịch phiêu lưu" },
                    { "CATE004", "Thoát khỏi cuộc sống bộn bề, thư giãn tại các resort, spa sang trọng. Tận hưởng dịch vụ cao cấp và không gian yên bình để phục hồi năng lượng, tìm lại cân bằng.", "Du lịch nghỉ dưỡng" },
                    { "CATE005", "Khám phá hương vị độc đáo của các vùng miền. Thưởng thức đặc sản địa phương, học cách chế biến món ăn truyền thống, trải nghiệm văn hóa ẩm thực sâu sắc.", "Du lịch ẩm thực" },
                    { "CATE006", "Hòa mình vào thiên nhiên hoang sơ. Tham quan rừng quốc gia, công viên bảo tồn, tìm hiểu hệ động thực vật đa dạng và tham gia các hoạt động thân thiện môi trường.", "Du lịch sinh thái" },
                    { "CATE007", "Tìm hiểu về tín ngưỡng và tôn giáo. Viếng thăm các ngôi chùa, nhà thờ, thánh địa linh thiêng, tham gia các nghi lễ truyền thống để tìm kiếm sự bình an trong tâm hồn.", "Du lịch tâm linh" },
                    { "CATE008", "Kết hợp du lịch với các hoạt động thể thao. Tham gia giải chạy, đạp xe, golf, lướt ván, hoặc chỉ đơn giản là duy trì lối sống năng động ngay cả trong kỳ nghỉ.", "Du lịch thể thao" },
                    { "CATE009", "Chinh phục đỉnh cao, khám phá bản làng vùng cao. Tận hưởng không khí trong lành, cảnh quan hùng vĩ của núi rừng, tìm hiểu văn hóa các dân tộc thiểu số đặc sắc.", "Du lịch miền núi" },
                    { "CATE010", "Khám phá nhịp sống sôi động của các đô thị lớn. Tham quan kiến trúc hiện đại và cổ kính, mua sắm tại các trung tâm thương mại, thưởng thức ẩm thực đường phố.", "Du lịch thành phố" },
                    { "CATE011", "Thiết kế đặc biệt cho các gia đình có trẻ nhỏ hoặc đa thế hệ. Bao gồm các hoạt động vui chơi giải trí phù hợp mọi lứa tuổi, tạo kỷ niệm đáng nhớ.", "Du lịch gia đình" },
                    { "CATE012", "Dành riêng cho các cặp đôi. Trải nghiệm lãng mạn, không gian riêng tư, các bữa tối dưới ánh nến, hoạt động thư giãn và tận hưởng thời gian chất lượng bên nhau.", "Du lịch cặp đôi" },
                    { "CATE013", "Tự do khám phá theo cách riêng. Lên kế hoạch linh hoạt, di chuyển tiết kiệm, hòa nhập với người dân địa phương, trải nghiệm chân thực và đầy ngẫu hứng.", "Du lịch bụi" },
                    { "CATE014", "Tận hưởng dịch vụ đẳng cấp và tiện nghi hoàn hảo. Nghỉ tại khách sạn 5 sao, di chuyển bằng phương tiện cao cấp, trải nghiệm ẩm thực tinh tế và các hoạt động độc quyền.", "Du lịch sang trọng" },
                    { "CATE015", "Trải nghiệm cuộc sống làng quê. Tham gia các hoạt động canh tác, thu hoạch nông sản, tìm hiểu quy trình sản xuất, thưởng thức sản phẩm tươi ngon ngay tại vườn.", "Du lịch nông nghiệp" },
                    { "CATE016", "Quay ngược thời gian khám phá các di tích lịch sử, chiến trường xưa, bảo tàng. Tìm hiểu về quá khứ hào hùng và những câu chuyện làm nên bản sắc dân tộc.", "Du lịch lịch sử" },
                    { "CATE017", "Du ngoạn trên sông, kênh rạch, khám phá cuộc sống miền Tây sông nước (hoặc các vùng sông nước khác). Tham quan chợ nổi, vườn cây ăn trái, làng nghề truyền thống.", "Du lịch sông nước" },
                    { "CATE018", "Khám phá vẻ đẹp kỳ vĩ và bí ẩn của các hệ thống hang động. Trải nghiệm đi bộ, leo trèo, bơi lội trong lòng hang, chiêm ngưỡng thạch nhũ hàng triệu năm tuổi.", "Du lịch hang động" },
                    { "CATE019", "Dành cho những người đam mê ghi lại khoảnh khắc. Khám phá các địa điểm có cảnh quan đẹp, văn hóa độc đáo, và con người thú vị để sáng tạo nên những bức ảnh ấn tượng.", "Du lịch nhiếp ảnh" },
                    { "CATE020", "Kết hợp nghỉ dưỡng với chăm sóc sức khỏe và sắc đẹp. Tham gia yoga, thiền, tắm bùn, suối khoáng nóng, trị liệu spa để thư giãn, tái tạo năng lượng và cải thiện sức khỏe.", "Du lịch sức khỏe" }
