                values: new object[,]
                {
                    { "TOUR001", "CATE001", new DateTime(2023, 8, 20, 10, 15, 0, 0, DateTimeKind.Unspecified), "Tham gia hành trình 2 ngày 1 đêm trên du thuyền sang trọng khám phá Vịnh Hạ Long, Di sản Thiên nhiên Thế giới. Chèo thuyền kayak qua các đảo đá vôi kỳ vĩ, ghé thăm hang Sửng Sốt, tắm biển và thưởng thức bữa tối hải sản lãng mạn trên boong tàu. Tour bao gồm phòng nghỉ riêng trên du thuyền, các bữa ăn và hoạt động theo lịch trình.", "2N1D", "LOC001", 20, "Vịnh Hạ Long: Du thuyền ngủ đêm và khám phá hang động", 8050000.0m, "Ngày 1: Đón tại Hà Nội (hoặc Hạ Long), lên du thuyền, ăn trưa, tham quan hang Sửng Sốt, chèo kayak, tắm biển Ti Tốp, ăn tối. Ngày 2: Học Thái Cực Quyền, ăn sáng, thăm làng chài, check-out, ăn trưa, về lại điểm đón.", "Trải nghiệm du thuyền cao cấp, ngắm cảnh vịnh huyền ảo.", new DateTime(2023, 9, 5, 11, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR002", "CATE006", new DateTime(2024, 1, 10, 9, 30, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm khám phá khu vực ít người biết đến hơn của Vịnh Hạ Long - Vịnh Lan Hạ. Tận hưởng không gian yên tĩnh, chèo kayak qua các hẻm núi nhỏ, khám phá đảo Khỉ và bãi Cát Dứa. Thử thách bản thân với các hoạt động như leo núi nhỏ hoặc đạp xe trên đảo Cát Bà. Trải nghiệm cuộc sống địa phương và ẩm thực tươi ngon.", "3N2D", "LOC001", 25, "Vịnh Hạ Long: Hành trình 3 ngày trên Vịnh Lan Hạ", 11960000.0m, "Ngày 1: Đón khách, lên du thuyền, đi Lan Hạ, chèo kayak, tắm biển. Ngày 2: Thăm đảo Khỉ, leo núi (tùy chọn), đạp xe Cát Bà (tùy chọn), tối thư giãn. Ngày 3: Ăn sáng, check-out, thăm hang Sáng Tối, về lại.", "Khám phá vẻ đẹp hoang sơ của Vịnh Lan Hạ kế cận Vịnh Hạ Long.", new DateTime(2024, 1, 25, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR003", "CATE005", new DateTime(2023, 5, 1, 15, 0, 0, 0, DateTimeKind.Unspecified), "Tour du lịch biển ngắn ngày tập trung vào trải nghiệm thư giãn và ẩm thực trên Vịnh Hạ Long. Chiều lên du thuyền, thưởng thức tiệc trà chiều ngắm hoàng hôn rực rỡ trên vịnh. Buổi tối, thưởng thức bữa tối hải sản đặc biệt với các món ăn chế biến từ nguyên liệu tươi sống. Tour thích hợp cho những ai có ít thời gian nhưng muốn tận hưởng không khí đặc trưng của Hạ Long.", "1N0D", "LOC001", 30, "Vịnh Hạ Long: Ngắm hoàng hôn và ẩm thực trên vịnh", 4140000.0m, "Ngày 1: Chiều lên du thuyền, ngắm cảnh, tiệc trà, ngắm hoàng hôn. Tối: Ăn tối hải sản đặc biệt. Sau bữa tối, tàu về bến, kết thúc tour.", "Tour ngắn thư giãn, ngắm cảnh và thưởng thức ẩm thực độc đáo.", new DateTime(2023, 5, 1, 15, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR004", "CATE003", new DateTime(2024, 3, 15, 11, 0, 0, 0, DateTimeKind.Unspecified), "Tour 2 ngày 1 đêm kết hợp khám phá sâu hơn các hang động kỳ vĩ và trải nghiệm hoạt động câu mực đêm thú vị trên Vịnh Hạ Long. Bên cạnh việc ngắm cảnh trên vịnh, bạn sẽ có cơ hội thám hiểm các hang động ít du khách biết đến và thử tài câu mực cùng ngư dân địa phương vào buổi tối. Thành quả có thể được chế biến ngay trên tàu.", "2N1D", "LOC001", 22, "Vịnh Hạ Long: Thám hiểm hang động và câu mực đêm", 8740000.0m, "Ngày 1: Lên tàu, ăn trưa, tham quan hang động (khác), chèo kayak. Tối: Ăn tối, hoạt động câu mực đêm. Ngày 2: Ăn sáng, thăm quan điểm cuối, về bến, kết thúc.", "Trải nghiệm khám phá hang động và hoạt động câu mực về đêm.", new DateTime(2024, 4, 1, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR005", "CATE019", new DateTime(2023, 11, 11, 8, 0, 0, 0, DateTimeKind.Unspecified), "Tour chuyên biệt dành cho những người yêu nhiếp ảnh, đưa bạn đến những góc đẹp nhất của Vịnh Hạ Long vào các thời điểm lý tưởng trong ngày (bình minh, hoàng hôn) để ghi lại những bức hình ấn tượng. Có hướng dẫn viên am hiểu các điểm chụp ảnh đẹp và điều kiện ánh sáng. Phù hợp cho cả người mới bắt đầu và nhiếp ảnh gia chuyên nghiệp.", "2N1D", "LOC001", 15, "Vịnh Hạ Long: Tour chụp ảnh kỳ vĩ", 9200000.0m, "Ngày 1: Đón khách, lên tàu, đến điểm chụp hoàng hôn, ăn tối. Ngày 2: Dậy sớm chụp bình minh, ăn sáng, thăm hang động/làng chài để chụp ảnh đời sống, về bến.", "Lưu giữ khoảnh khắc tuyệt đẹp của Vịnh Hạ Long qua ống kính.", new DateTime(2023, 11, 11, 8, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR006", "CATE002", new DateTime(2022, 7, 5, 14, 0, 0, 0, DateTimeKind.Unspecified), "Khám phá vẻ đẹp vượt thời gian của Phố cổ Hội An, Di sản Văn hóa Thế giới. Đi bộ qua các con phố đèn lồng rực rỡ, thăm các hội quán, nhà cổ, chùa Cầu. Tham gia các lớp học làm đèn lồng, làm gốm hoặc học nấu món ăn địa phương. Tour mang đến trải nghiệm sâu sắc về lịch sử, văn hóa và đời sống người dân Hội An.", "2N1D", "LOC002", 35, "Hội An: Dạo bước phố cổ và trải nghiệm nghề truyền thống", 3450000.0m, "Ngày 1: Thăm phố cổ, nhà cổ Tấn Ký, Hội quán Phúc Kiến, Chùa Cầu, đi thuyền sông Hoài, thả đèn hoa đăng. Ngày 2: Tham gia lớp học làm đèn lồng/gốm, thăm làng rau Trà Quế (tùy chọn), mua sắm đặc sản.", "Hòa mình vào không gian cổ kính và văn hóa Hội An.", new DateTime(2022, 7, 10, 10, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR007", "CATE005", new DateTime(2023, 3, 20, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour đặc biệt dành cho tín đồ ẩm thực và muốn tìm hiểu cuộc sống yên bình vùng quê Hội An. Dạo quanh các gánh hàng rong, thưởng thức các món ăn đường phố nổi tiếng như Cao Lầu, Mì Quảng, Bánh Mì Phượng. Sau đó, đạp xe khám phá các làng nghề truyền thống hoặc làng rau hữu cơ quanh phố cổ, tìm hiểu quy trình canh tác và giao lưu với người dân địa phương.", "2N1D", "LOC002", 20, "Hội An: Tour ẩm thực đường phố và làng quê thanh bình", 4140000.0m, "Ngày 1: Tour ẩm thực đường phố buổi chiều/tối, thử các món đặc sản. Ngày 2: Đạp xe ra vùng quê, thăm làng rau Trà Quế/làng nghề, ăn trưa tại nhà dân (tùy chọn), về lại phố cổ.", "Khám phá hương vị đặc trưng và cuộc sống bình dị Hội An.", new DateTime(2023, 4, 15, 16, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR008", "CATE016", new DateTime(2024, 2, 1, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour tập trung vào khía cạnh lịch sử và kiến trúc của Hội An trong thời kỳ là một thương cảng sầm uất. Thăm các công trình kiến trúc cổ mang đậm dấu ấn giao thoa văn hóa Việt Nam, Nhật Bản, Trung Quốc. Nghe kể chuyện về con đường tơ lụa trên biển, cuộc sống của các thương nhân nước ngoài và sự phát triển của đô thị cổ. Bao gồm vé tham quan các điểm di tích chính.", "2N1D", "LOC002", 30, "Hội An: Lịch sử và Kiến trúc của Thương cảng xưa", 2990000.0m, "Ngày 1: Giới thiệu tổng quan, thăm Chùa Cầu, các Hội Quán Trung Hoa, nhà cổ tiêu biểu. Ngày 2: Thăm Bảo tàng Văn hóa Hội An, xưởng thủ công mỹ nghệ, nghe thuyết minh về lịch sử thương mại.", "Tìm hiểu lịch sử vàng son của Thương cảng quốc tế Hội An.", new DateTime(2024, 2, 20, 11, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR009", "CATE012", new DateTime(2023, 9, 10, 15, 0, 0, 0, DateTimeKind.Unspecified), "Thiết kế dành riêng cho các cặp đôi, tour mang đến không gian lãng mạn và những trải nghiệm đáng nhớ tại Hội An. Dạo bộ dưới ánh đèn lồng lung linh, đi thuyền ngắm hoàng hôn trên sông Hoài, thả đèn hoa đăng cầu nguyện. Thưởng thức bữa tối lãng mạn bên sông, tham gia lớp học nấu ăn riêng hoặc đạp xe thư giãn qua những cánh đồng lúa xanh mướt. Lưu trú tại resort hoặc khách sạn boutique có không gian riêng tư.", "2N1D", "LOC002", 10, "Hội An: Trải nghiệm lãng mạn cho cặp đôi", 11500000.0m, "Ngày 1: Nhận phòng, dạo phố cổ, đi thuyền ngắm hoàng hôn, thả đèn hoa đăng, ăn tối lãng mạn. Ngày 2: Tùy chọn (lớp nấu ăn/đạp xe), mua sắm quà lưu niệm, thư giãn.", "Không gian lãng mạn và trải nghiệm độc đáo tại Hội An.", new DateTime(2023, 9, 10, 15, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR010", "CATE004", new DateTime(2024, 4, 5, 9, 30, 0, 0, DateTimeKind.Unspecified), "Tour kết hợp khám phá vẻ đẹp cổ kính của Phố cổ Hội An và thư giãn tại bãi biển An Bàng gần đó. Dành một phần thời gian để dạo bộ, mua sắm, thưởng thức ẩm thực trong phố cổ. Phần còn lại tận hưởng không khí biển trong lành, tắm nắng, bơi lội hoặc tham gia các hoạt động thể thao dưới nước tại bãi biển An Bàng xinh đẹp. Mang đến sự cân bằng giữa văn hóa và nghỉ dưỡng.", "2N1D", "LOC002", 28, "Hội An: Kết hợp phố cổ và biển An Bàng", 4600000.0m, "Ngày 1: Thăm phố cổ Hội An (nhà cổ, chùa Cầu, hội quán), ăn tối đặc sản. Ngày 2: Di chuyển ra biển An Bàng, tắm biển, thư giãn, ăn trưa hải sản, về lại.", "Trải nghiệm sự kết hợp độc đáo giữa phố cổ và biển.", new DateTime(2024, 4, 20, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR011", "CATE002", new DateTime(2022, 11, 15, 10, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm đưa bạn về với Cố đô Huế trầm mặc, nơi từng là kinh đô của triều Nguyễn. Thăm Đại Nội, Hoàng thành, Tử Cấm thành, khám phá các cung điện, lăng tẩm uy nghiêm của các vị vua. Ngồi thuyền Rồng nghe ca Huế trên sông Hương, ghé thăm chùa Thiên Mụ và tìm hiểu về đời sống cung đình xưa. Bao gồm vé tham quan các di tích chính.", "3N2D", "LOC003", 40, "Huế: Hành trình khám phá Cố đô và Di sản", 5750000.0m, "Ngày 1: Thăm Đại Nội (Hoàng thành, Tử Cấm thành), Bảo tàng Cổ vật Cung đình Huế. Tối: Nghe ca Huế trên sông Hương. Ngày 2: Thăm lăng Minh Mạng, lăng Khải Định, chùa Thiên Mụ. Ngày 3: Thăm lăng Tự Đức, chợ Đông Ba, mua sắm đặc sản.", "Tìm hiểu lịch sử, văn hóa của Kinh thành Huế xưa.", new DateTime(2022, 12, 1, 11, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR012", "CATE007", new DateTime(2023, 1, 20, 8, 30, 0, 0, DateTimeKind.Unspecified), "Huế không chỉ nổi tiếng với di sản cung đình mà còn là trung tâm Phật giáo với nhiều chùa cổ kính. Tour này tập trung vào khám phá các ngôi chùa nổi tiếng như chùa Thiên Mụ, Từ Hiếu, và tìm hiểu về đời sống tâm linh của người dân xứ Huế. Đồng thời, bạn sẽ có cơ hội thưởng thức ẩm thực chay phong phú và tinh tế - một nét văn hóa đặc sắc của Huế.", "2N1D", "LOC003", 25, "Huế: Du lịch tâm linh và ẩm thực chay", 4140000.0m, "Ngày 1: Thăm chùa Thiên Mụ, chùa Từ Hiếu, tìm hiểu về Phật giáo Huế. Tối: Ăn tối buffet chay đặc sắc. Ngày 2: Thăm các am/tịnh thất nhỏ (nếu có), giao lưu với Phật tử, học làm một món chay đơn giản (tùy chọn).", "Khám phá nét đẹp tâm linh và thưởng thức ẩm thực chay Huế.", new DateTime(2023, 1, 20, 8, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR013", "CATE002", new DateTime(2024, 3, 10, 14, 0, 0, 0, DateTimeKind.Unspecified), "Khác với các tour cung đình, tour này đưa bạn ra ngoại thành Huế để khám phá các làng nghề truyền thống như làm nón lá, làm hương trầm, làm hoa giấy Thanh Tiên. Đi thuyền trên sông Hương đến các làng nghề, tìm hiểu quy trình làm sản phẩm, giao lưu với những người thợ thủ công tài hoa. Trải nghiệm cuộc sống bình dị, yên ả của người dân ven sông Hương.", "2N1D", "LOC003", 30, "Huế: Làng nghề truyền thống và đời sống ven sông Hương", 3680000.0m, "Ngày 1: Đi thuyền sông Hương, thăm làng nghề làm nón lá/hương trầm. Ngày 2: Thăm làng hoa giấy Thanh Tiên, thưởng thức ẩm thực địa phương tại làng.", "Tìm hiểu các làng nghề và cuộc sống bình dị ven sông Hương.", new DateTime(2024, 3, 18, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR014", "CATE016", new DateTime(2023, 7, 1, 9, 30, 0, 0, DateTimeKind.Unspecified), "Tour tập trung vào việc khám phá các lăng tẩm của các vị vua Nguyễn, mỗi lăng mang một phong cách kiến trúc và câu chuyện lịch sử riêng. Thăm lăng Gia Long (lăng Thiên Thọ) uy nghiêm giữa thiên nhiên, lăng Minh Mạng (Hiếu lăng) với bố cục cân đối, lăng Tự Đức (Khiêm lăng) trữ tình thơ mộng, và lăng Khải Định (Ứng lăng) với sự kết hợp Đông-Tây phức tạp. Tìm hiểu về quan niệm sống và chết của các vị vua qua kiến trúc lăng mộ của họ.", "3N2D", "LOC003", 20, "Huế: Khám phá lăng tẩm cổ kính và kiến trúc độc đáo", 6440000.0m, "Ngày 1: Thăm lăng Minh Mạng, lăng Thiệu Trị. Ngày 2: Thăm lăng Tự Đức, lăng Đồng Khánh. Ngày 3: Thăm lăng Khải Định, lăng Gia Long.", "Hành trình sâu vào kiến trúc và lịch sử các lăng tẩm triều Nguyễn.", new DateTime(2023, 7, 25, 15, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR015", "CATE006", new DateTime(2024, 1, 5, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour kết hợp khám phá các di tích lịch sử trong Cố đô Huế và trải nghiệm vẻ đẹp hoang sơ, yên bình của Phá Tam Giang - đầm phá lớn nhất Đông Nam Á. Buổi chiều hoặc sáng sớm ra phá ngắm bình minh hoặc hoàng hôn tuyệt đẹp, đi thuyền trên phá, tìm hiểu đời sống ngư dân địa phương và thưởng thức hải sản tươi sống. Mang đến sự kết hợp giữa lịch sử và sinh thái.", "2N1D", "LOC003", 25, "Huế: Kết hợp Cố đô và Phá Tam Giang", 5060000.0m, "Ngày 1: Thăm Đại Nội/lăng tẩm (buổi sáng), di chuyển ra Phá Tam Giang buổi chiều, đi thuyền, ngắm hoàng hôn, ăn tối hải sản. Ngày 2: Buổi sáng tự do/mua sắm tại Huế, kết thúc tour.", "Trải nghiệm di sản Huế và vẻ đẹp bình minh/hoàng hôn Phá Tam Giang.", new DateTime(2024, 1, 15, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR016", "CATE003", new DateTime(2023, 4, 10, 11, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình khám phá Vườn quốc gia Phong Nha-Kẻ Bàng, Di sản Thiên nhiên Thế giới. Đi thuyền trên sông Son vào động Phong Nha - động nước dài nhất Việt Nam, ngắm nhìn hệ thống thạch nhũ và măng đá kỳ ảo. Sau đó, leo bộ khám phá động Tiên Sơn với vẻ đẹp khô ráo, lung linh như chốn bồng lai tiên cảnh. Tour cơ bản và phổ biến nhất tại Phong Nha.", "2N1D", "LOC004", 30, "Phong Nha: Thám hiểm động Phong Nha và Tiên Sơn", 4370000.0m, "Ngày 1: Đến Phong Nha, đi thuyền sông Son, thăm động Phong Nha. Buổi chiều: Thăm động Tiên Sơn. Tối: Nghỉ ngơi tại Phong Nha.", "Khám phá vẻ đẹp kỳ vĩ của hai động nổi tiếng nhất Phong Nha.", new DateTime(2023, 4, 20, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR017", "CATE003", new DateTime(2024, 5, 1, 8, 0, 0, 0, DateTimeKind.Unspecified), "Tour phiêu lưu mạo hiểm tại Vườn quốc gia Phong Nha-Kẻ Bàng. Tham gia Zipline vượt sông Chày dài nhất Việt Nam để đến hang Tối. Khám phá hang Tối bằng đèn pin đội đầu, lội bùn khoáng tự nhiên trong hang (có lợi cho sức khỏe). Sau đó, tham gia các hoạt động vui chơi dưới nước trên sông Chày như bơi lội, chèo kayak. Phù hợp với người trẻ và yêu thích thử thách.", "1N0D", "LOC004", 25, "Phong Nha: Phiêu lưu Zipline và tắm bùn hang Tối", 2760000.0m, "Ngày 1: Đến Phong Nha, di chuyển đến sông Chày/hang Tối. Tham gia Zipline, khám phá hang Tối (lội bùn), tắm sông Chày, vui chơi dưới nước.", "Trải nghiệm mạo hiểm và thư giãn tại hang Tối.", new DateTime(2024, 5, 1, 8, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR018", "CATE003", new DateTime(2023, 6, 1, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour trekking và thám hiểm 3 ngày 2 đêm đưa bạn vào sâu trong Vườn quốc gia Phong Nha-Kẻ Bàng, khám phá Hang Én - hang động lớn thứ 3 thế giới và nơi cắm trại tuyệt đẹp bên hồ nước trong hang. Đi bộ xuyên rừng, băng suối, tìm hiểu hệ sinh thái độc đáo và thử thách giới hạn bản thân. Tour yêu cầu thể lực tốt và tinh thần phiêu lưu. Bao gồm trang thiết bị cắm trại và hướng dẫn viên chuyên nghiệp.", "3N2D", "LOC004", 15, "Phong Nha: Thám hiểm Vườn quốc gia và Hang Én (3 ngày)", 19550000.0m, "Ngày 1: Trekking vào rừng, ăn trưa, tiếp tục đi bộ đến Hang Én, dựng trại, ăn tối, cắm trại trong hang. Ngày 2: Khám phá sâu hơn Hang Én, tắm hồ trong hang (tùy chọn), ăn sáng/trưa/tối tại hang. Ngày 3: Ăn sáng, thu dọn, trekking ra ngoài, kết thúc.", "Hành trình trekking và cắm trại đầy thử thách đến Hang Én.", new DateTime(2023, 6, 1, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR019", "CATE006", new DateTime(2022, 9, 1, 10, 30, 0, 0, DateTimeKind.Unspecified), "Tour kết hợp khám phá Động Thiên Đường, được mệnh danh là 'hoàng cung trong lòng đất' với hệ thống thạch nhũ tráng lệ và quy mô rộng lớn. Sau đó, thư giãn và vui chơi tại Suối Nước Moọc, một điểm du lịch sinh thái với dòng suối trong xanh, cầu tre và các hoạt động như chèo kayak, tắm suối. Phù hợp cho gia đình và nhóm bạn.", "1N0D", "LOC004", 35, "Phong Nha: Khám phá Động Thiên Đường và Suối Nước Moọc", 2990000.0m, "Ngày 1: Thăm Động Thiên Đường (đi bộ hoặc xe golf), ăn trưa. Chiều: Đến Suối Nước Moọc, tắm suối, vui chơi, chèo kayak.", "Ngắm vẻ đẹp kỳ vĩ của động khô và thư giãn tại suối.", new DateTime(2022, 9, 1, 10, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR020", "CATE006", new DateTime(2023, 10, 20, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour đạp xe khám phá các cung đường đẹp nhất trong Vườn quốc gia Phong Nha-Kẻ Bàng. Đạp xe qua những cánh đồng lúa, làng quê yên bình, men theo bờ sông Son và vào sâu trong rừng. Ngắm nhìn cảnh quan núi đá vôi hùng vĩ, gặp gỡ người dân địa phương. Tour yêu cầu thể lực vừa phải, phù hợp với người yêu thiên nhiên và hoạt động ngoài trời. Bao gồm xe đạp và hướng dẫn viên địa phương.", "1N0D", "LOC004", 20, "Phong Nha: Trải nghiệm đạp xe xuyên vườn quốc gia", 2300000.0m, "Ngày 1: Bắt đầu đạp xe từ Phong Nha, đi qua các làng quê, cánh đồng, đến điểm nghỉ trưa. Chiều: Đạp xe vào khu vực rừng (tùy chọn), về lại Phong Nha.", "Đạp xe khám phá cảnh quan thiên nhiên hùng vĩ Phong Nha.", new DateTime(2023, 10, 20, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR021", "CATE016", new DateTime(2022, 8, 10, 8, 30, 0, 0, DateTimeKind.Unspecified), "Thăm Thánh địa Mỹ Sơn, Di sản Văn hóa Thế giới - quần thể đền tháp Champa cổ kính ẩn mình trong thung lũng. Tìm hiểu về lịch sử, kiến trúc, tôn giáo của Vương quốc Champa từng tồn tại ở miền Trung Việt Nam. Ngắm nhìn các công trình kiến trúc độc đáo bằng gạch nung và đá sa thạch, xem biểu diễn múa Chăm truyền thống. Tour văn hóa lịch sử sâu sắc.", "1N0D", "LOC005", 40, "Mỹ Sơn: Khám phá Thánh địa Ấn Độ giáo cổ", 1840000.0m, "Ngày 1: Di chuyển đến Mỹ Sơn (từ Đà Nẵng/Hội An), thăm quan khu di tích, nghe thuyết minh, xem múa Chăm. Kết thúc tour vào buổi trưa/chiều.", "Hành trình về quá khứ huy hoàng của Vương quốc Champa.", new DateTime(2022, 8, 10, 8, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR022", "CATE019", new DateTime(2024, 1, 18, 5, 0, 0, 0, DateTimeKind.Unspecified), "Tour đặc biệt khởi hành sớm để đến Thánh địa Mỹ Sơn vào lúc bình minh. Ngắm nhìn ánh nắng đầu tiên chiếu rọi lên các đền tháp cổ, tạo nên khung cảnh huyền ảo và linh thiêng. Trải nghiệm không khí yên bình, tĩnh lặng của di tích trước khi có nhiều khách du lịch. Cơ hội tuyệt vời cho những người yêu thích nhiếp ảnh và không gian trầm mặc.", "1N0D", "LOC005", 20, "Mỹ Sơn: Bình minh huyền ảo tại Thánh địa", 2300000.0m, "Ngày 1: Khởi hành sớm (trước bình minh), đến Mỹ Sơn, ngắm bình minh, thăm quan khu di tích, ăn sáng nhẹ. Kết thúc tour buổi sáng.", "Ngắm bình minh và khám phá Thánh địa trong không khí tĩnh lặng.", new DateTime(2024, 1, 18, 5, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR023", "CATE002", new DateTime(2023, 5, 25, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour kết hợp thăm Thánh địa Mỹ Sơn và khám phá các làng nghề truyền thống xung quanh như làng gốm Thanh Hà (Hội An) hoặc các làng dệt lụa. Tìm hiểu về mối liên hệ lịch sử giữa Thánh địa và các khu vực dân cư, quan sát quy trình làm ra các sản phẩm thủ công truyền thống và mua sắm quà lưu niệm độc đáo. Mang đến cái nhìn toàn diện hơn về khu vực này.", "1N0D", "LOC005", 25, "Mỹ Sơn: Kết hợp văn hóa Champa và làng nghề truyền thống", 2530000.0m, "Ngày 1: Thăm Thánh địa Mỹ Sơn. Chiều: Di chuyển đến làng gốm Thanh Hà/làng dệt lụa, tìm hiểu quy trình, giao lưu, mua sắm.", "Tìm hiểu văn hóa Champa và các làng nghề lân cận Mỹ Sơn.", new DateTime(2023, 5, 25, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR024", "CATE016", new DateTime(2024, 4, 10, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour tập trung vào việc cung cấp thông tin chi tiết và chuyên sâu về lịch sử xây dựng, chức năng, ý nghĩa tôn giáo và các kỹ thuật xây dựng bí ẩn của các đền tháp tại Thánh địa Mỹ Sơn. Có hướng dẫn viên chuyên môn cao, am hiểu sâu về văn hóa Champa. Phù hợp với những người yêu thích lịch sử, khảo cổ và muốn tìm hiểu kỹ lưỡng về di tích.", "1N0D", "LOC005", 15, "Mỹ Sơn: Lịch sử và câu chuyện những ngôi đền cổ", 2070000.0m, "Ngày 1: Thăm quan khu di tích Mỹ Sơn theo các cụm tháp, nghe thuyết minh chi tiết về lịch sử, kiến trúc, điêu khắc. Thảo luận và giải đáp thắc mắc.", "Tìm hiểu sâu về lịch sử và ý nghĩa các đền tháp Champa.", new DateTime(2024, 4, 10, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR025", "CATE002", new DateTime(2023, 12, 1, 8, 45, 0, 0, DateTimeKind.Unspecified), "Bên cạnh việc thăm Thánh địa Mỹ Sơn, tour này nhấn mạnh vào trải nghiệm văn hóa Chăm đương đại. Thưởng thức chương trình biểu diễn múa Chăm truyền thống (đặc biệt là điệu múa Apsara) tại khu vực Mỹ Sơn. Có cơ hội giao lưu với các nghệ nhân, tìm hiểu về trang phục, nhạc cụ và đời sống văn hóa của cộng đồng người Chăm hiện nay. Mang đến trải nghiệm đa chiều về văn hóa Champa.", "1N0D", "LOC005", 30, "Mỹ Sơn: Trải nghiệm văn hóa Chăm và múa Apsara", 2185000.0m, "Ngày 1: Thăm quan khu di tích Mỹ Sơn, nghe thuyết minh. Buổi chiều: Xem biểu diễn múa Chăm truyền thống, tìm hiểu về văn hóa Chăm.", "Thưởng thức nghệ thuật biểu diễn và tìm hiểu văn hóa Chăm.", new DateTime(2023, 12, 1, 8, 45, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR026", "CATE010", new DateTime(2022, 10, 5, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour đi bộ khám phá Khu phố cổ Hà Nội (36 phố phường) với lịch sử nghìn năm văn hiến. Lạc bước qua những con phố nhỏ với kiến trúc nhà cổ, thăm các đền, chùa, hội quán linh thiêng. Thưởng thức ẩm thực đường phố đặc sắc của Hà Nội. Tìm hiểu về sự hình thành và phát triển của khu phố cổ, đời sống và văn hóa của người dân nơi đây. Bao gồm hướng dẫn viên am hiểu văn hóa Hà Nội.", "1N0D", "LOC009", 20, "Hà Nội: Khám phá 36 phố phường và nét cổ kính", 1610000.0m, "Ngày 1: Thăm Hồ Gươm, đền Ngọc Sơn. Đi bộ khu phố cổ: Hàng Mã, Hàng Gai, Mã Mây (Nhà cổ), Đền Bạch Mã. Ăn tối món ăn đường phố (phở, bún chả...).", "Dạo bộ và tìm hiểu về lịch sử khu phố cổ Hà Nội.", new DateTime(2022, 10, 5, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR027", "CATE016", new DateTime(2023, 11, 20, 10, 30, 0, 0, DateTimeKind.Unspecified), "Tour tập trung vào các di tích lịch sử và văn hóa quan trọng của Hà Nội. Thăm Khu di tích Hoàng thành Thăng Long - Di sản Văn hóa Thế giới, tìm hiểu về các triều đại phong kiến Việt Nam. Viếng Lăng Chủ tịch Hồ Chí Minh (tùy theo thời gian mở cửa), thăm Quảng trường Ba Đình và Bảo tàng Hồ Chí Minh. Tour cung cấp cái nhìn sâu sắc về lịch sử cận đại và hiện đại của Việt Nam.", "1N0D", "LOC009", 30, "Hà Nội: Di sản Hoàng thành Thăng Long và Lăng Bác", 2070000.0m, "Ngày 1: Thăm Hoàng thành Thăng Long. Chiều: Thăm Lăng Bác (bên ngoài/viếng nếu mở cửa), Quảng trường Ba Đình, Bảo tàng Hồ Chí Minh, Chùa Một Cột.", "Tìm hiểu về lịch sử và di sản quan trọng của Hà Nội.", new DateTime(2023, 11, 20, 10, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR028", "CATE005", new DateTime(2024, 2, 14, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour trải nghiệm ẩm thực chuyên sâu tại Hà Nội. Bắt đầu bằng chuyến đi chợ địa phương để mua nguyên liệu tươi ngon. Sau đó, tham gia lớp học nấu ăn do đầu bếp chuyên nghiệp hướng dẫn, tự tay chế biến các món ăn truyền thống của Hà Nội như phở cuốn, nem rán, bún chả. Kết thúc bằng việc thưởng thức thành quả của mình. Tour mang tính tương tác cao và phù hợp với người yêu ẩm thực.", "1N0D", "LOC009", 15, "Hà Nội: Ẩm thực tinh hoa và lớp học nấu ăn Việt", 3450000.0m, "Ngày 1: Sáng đi chợ địa phương, tham gia lớp học nấu ăn (lý thuyết và thực hành), ăn trưa với món tự nấu.", "Thưởng thức và tự tay chế biến món ngon Hà Nội.", new DateTime(2024, 2, 14, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR029", "CATE006", new DateTime(2023, 4, 1, 8, 0, 0, 0, DateTimeKind.Unspecified), "Tour một ngày từ Hà Nội đi Ninh Bình (khu vực Tràng An), khám phá cố đô Hoa Lư thời Đinh-Tiền Lê và cảnh quan Tam Cốc Bích Động được ví như 'Vịnh Hạ Long trên cạn'. Đi thuyền qua các hang động và cánh đồng lúa hai bên dòng sông Ngô Đồng. Thăm chùa Bích Động và các di tích khác trong khu vực. Tour mang đến trải nghiệm thiên nhiên và lịch sử độc đáo gần Hà Nội.", "1N0D", "LOC009", 40, "Hà Nội: Về miền di sản quanh Hà Nội (Hoa Lư - Tam Cốc)", 2530000.0m, "Ngày 1: Khởi hành từ Hà Nội đi Ninh Bình. Thăm Hoa Lư, Tam Cốc (đi thuyền). Ăn trưa. Chiều thăm chùa Bích Động. Trở về Hà Nội.", "Khám phá cố đô Hoa Lư và cảnh sắc Tam Cốc Bích Động.", new DateTime(2023, 4, 1, 8, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR030", "CATE002", new DateTime(2023, 8, 8, 9, 30, 0, 0, DateTimeKind.Unspecified), "Tour đưa bạn ra khỏi trung tâm ồn ào để khám phá cuộc sống dân dã và các làng nghề truyền thống ở ngoại ô Hà Nội. Thăm làng gốm Bát Tràng, tìm hiểu quy trình làm gốm và tự tay nặn thử. Ghé thăm làng lụa Vạn Phúc hoặc làng mây tre đan. Giao lưu với người dân địa phương, tìm hiểu về nghề truyền thống của họ. Tour mang đến cái nhìn chân thực về văn hóa và đời sống ngoại thành.", "1N0D", "LOC009", 25, "Hà Nội: Trải nghiệm đời sống dân dã ngoại thành", 1955000.0m, "Ngày 1: Di chuyển đến làng gốm Bát Tràng, thăm quan, học làm gốm. Ăn trưa. Chiều: Thăm làng lụa Vạn Phúc/làng nghề khác, mua sắm quà lưu niệm.", "Khám phá cuộc sống bình dị và làng nghề ngoại ô Hà Nội.", new DateTime(2023, 8, 8, 9, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR031", "CATE010", new DateTime(2022, 12, 10, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour khám phá trung tâm TP. Hồ Chí Minh, kết hợp giữa các công trình kiến trúc Pháp cổ và nét hiện đại sôi động. Thăm Dinh Độc Lập, Bưu điện Trung tâm Sài Gòn, Nhà thờ Đức Bà (bên ngoài do sửa chữa), Bảo tàng Chứng tích Chiến tranh, chợ Bến Thành. Tìm hiểu về lịch sử phát triển của Sài Gòn từ thời Pháp thuộc đến nay. Tour phù hợp cho những người muốn có cái nhìn tổng quan về thành phố.", "1N0D", "LOC010", 35, "TP. Hồ Chí Minh: Khám phá trung tâm Sài Gòn hiện đại và cổ kính", 1840000.0m, "Ngày 1: Thăm Dinh Độc Lập, Bưu điện, Nhà thờ Đức Bà, Đường sách. Ăn trưa. Chiều: Thăm Bảo tàng Chứng tích Chiến tranh, mua sắm tại chợ Bến Thành.", "Dạo quanh các điểm nổi bật của Sài Gòn xưa và nay.", new DateTime(2022, 12, 10, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR032", "CATE005", new DateTime(2023, 6, 18, 18, 0, 0, 0, DateTimeKind.Unspecified), "Tour ẩm thực về đêm sôi động tại TP. Hồ Chí Minh. Dạo quanh các khu vực tập trung nhiều món ăn đường phố nổi tiếng như Quận 4, Quận 5, hoặc các khu chợ đêm. Thử các món như bánh xèo, cơm tấm, hủ tiếu gõ, các loại ốc, phá lấu, và tráng miệng. Trải nghiệm không khí nhộn nhịp và phong cách ẩm thực đa dạng của Sài Gòn. Thường di chuyển bằng xe máy (có người lái).", "1N0D", "LOC010", 20, "TP. Hồ Chí Minh: Ẩm thực đường phố Sài Gòn về đêm", 1380000.0m, "Ngày 1: Tối bắt đầu tour, di chuyển qua các khu vực ẩm thực, thử các món ăn đặc trưng tại các quán nổi tiếng, kết thúc tour vào buổi tối muộn.", "Thưởng thức hương vị đặc sắc của Sài Gòn về đêm.", new DateTime(2023, 6, 18, 18, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR033", "CATE016", new DateTime(2024, 3, 1, 8, 30, 0, 0, DateTimeKind.Unspecified), "Tour đưa bạn đến Địa đạo Củ Chi, một di tích lịch sử quan trọng nằm cách trung tâm TP. Hồ Chí Minh khoảng 70km. Khám phá hệ thống đường hầm dưới lòng đất được sử dụng trong chiến tranh Việt Nam. Tìm hiểu về cuộc sống và cách chiến đấu của quân giải phóng. Có cơ hội xem phim tư liệu, chui thử địa đạo (tùy chọn), và trải nghiệm bắn súng (chi phí tự túc). Tour mang tính giáo dục và lịch sử sâu sắc.", "1N0D", "LOC010", 45, "TP. Hồ Chí Minh: Tham quan Địa đạo Củ Chi", 1150000.0m, "Ngày 1: Di chuyển đến Củ Chi. Thăm khu di tích Địa đạo Củ Chi, xem phim, nghe thuyết minh, khám phá đường hầm, xem bẫy chông, khu tái hiện đời sống.", "Tìm hiểu về hệ thống địa đạo trong chiến tranh.", new DateTime(2024, 3, 1, 8, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR034", "CATE006", new DateTime(2023, 9, 5, 7, 30, 0, 0, DateTimeKind.Unspecified), "Tour kết hợp khám phá các điểm nổi bật của TP. Hồ Chí Minh và một chuyến đi ngắn đến khu vực Đồng bằng sông Cửu Long gần đó (ví dụ: Mỹ Tho, Bến Tre). Thăm quan thành phố buổi sáng, sau đó di chuyển đến miền Tây, đi thuyền trên sông, thăm các cù lao, vườn cây ăn trái, lò kẹo dừa, nghe đờn ca tài tử. Mang đến sự đa dạng về cảnh quan và văn hóa chỉ trong một hành trình ngắn.", "1N0D", "LOC010", 30, "TP. Hồ Chí Minh: Kết hợp thành phố và sông nước miền Tây", 2760000.0m, "Ngày 1: Thăm các điểm trung tâm Sài Gòn (sáng). Chiều: Di chuyển xuống miền Tây, đi thuyền, thăm cù lao, làng nghề, nghe nhạc truyền thống. Tối: Trở về TP.HCM.", "Trải nghiệm sự khác biệt giữa đô thị và miền Tây sông nước.", new DateTime(2023, 9, 5, 7, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR035", "CATE002", new DateTime(2024, 4, 22, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour đi bộ khám phá khu Chợ Lớn (Quận 5), trung tâm của cộng đồng người Hoa tại TP. Hồ Chí Minh. Thăm các hội quán cổ kính, chùa miếu linh thiêng mang đậm kiến trúc Trung Hoa. Dạo quanh các con phố, chợ truyền thống, ngắm nhìn nghệ thuật đường phố (các bức vẽ, bảng hiệu cổ). Đặc biệt, thưởng thức ẩm thực đặc sắc của khu vực này như mì vịt tiềm, sủi cảo, dimsum... Tour mang đến trải nghiệm văn hóa và ẩm thực đa dạng.", "1N0D", "LOC010", 25, "TP. Hồ Chí Minh: Nghệ thuật đường phố và ẩm thực khu Chợ Lớn", 1725000.0m, "Ngày 1: Thăm quan các hội quán, chùa miếu tại Chợ Lớn. Đi bộ khám phá khu vực. Tối: Tour ẩm thực đường phố Chợ Lớn, thử các món ăn đặc trưng.", "Khám phá nét văn hóa độc đáo và ẩm thực khu Chợ Lớn.", new DateTime(2024, 4, 22, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR036", "CATE016", new DateTime(2022, 11, 1, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tham quan Khu di tích Hoàng thành Thăng Long, Di sản Văn hóa Thế giới. Tìm hiểu về lịch sử hình thành và phát triển của kinh đô Thăng Long qua các triều đại Đinh, Tiền Lê, Lý, Trần, Lê, Mạc, Nguyễn. Khám phá các di tích khảo cổ học, các công trình kiến trúc còn sót lại như Đoan Môn, Điện Kính Thiên, Hậu Lâu, Cột cờ Hà Nội. Tour mang tính lịch sử và văn hóa sâu sắc.", "1N0D", "LOC006", 35, "Hoàng thành Thăng Long: Hành trình Di sản nghìn năm", 1380000.0m, "Ngày 1: Thăm Đoan Môn, Điện Kính Thiên, Hậu Lâu. Khám phá khu khảo cổ 18 Hoàng Diệu. Thăm Cột cờ Hà Nội.", "Khám phá trung tâm quyền lực của Việt Nam xưa.", new DateTime(2022, 11, 1, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR037", "CATE016", new DateTime(2023, 3, 15, 9, 0, 0, 0, DateTimeKind.Unspecified), "Bên cạnh các di tích cổ, Hoàng thành Thăng Long còn lưu giữ các di tích lịch sử hiện đại quan trọng. Tour này tập trung vào việc thăm quan và tìm hiểu về Hầm chỉ huy Tác chiến D67, nơi làm việc của các vị tướng trong chiến tranh Việt Nam, và Nhà con Rồng (Long House) - khu làm việc của Bộ Chính trị và Quân ủy Trung ương. Tour mang đến góc nhìn về lịch sử cách mạng Việt Nam.", "1N0D", "LOC006", 25, "Hoàng thành Thăng Long: Khám phá hầm chỉ huy D67 và nhà con Rồng", 1265000.0m, "Ngày 1: Thăm khu trung tâm Hoàng thành, sau đó tập trung vào Hầm chỉ huy D67 và Nhà con Rồng. Nghe thuyết minh về lịch sử khu vực này.", "Tìm hiểu lịch sử hiện đại tại Hoàng thành.", new DateTime(2023, 3, 15, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR038", "CATE016", new DateTime(2024, 1, 30, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour dành cho những người quan tâm đến khảo cổ học và quá trình khai quật tại Hoàng thành Thăng Long. Thăm khu di tích khảo cổ 18 Hoàng Diệu, nơi phát hiện ra nhiều tầng văn hóa chồng xếp của các thời kỳ lịch sử khác nhau. Tìm hiểu về các hiện vật được khai quật, ý nghĩa của chúng và quá trình nghiên cứu di tích. Có thể có buổi nói chuyện ngắn với nhà nghiên cứu (tùy lịch trình).", "1N0D", "LOC006", 15, "Hoàng thành Thăng Long: Khảo cổ và những tầng di tích", 1610000.0m, "Ngày 1: Thăm khu di tích khảo cổ 18 Hoàng Diệu, nghe thuyết minh chuyên sâu về các tầng di tích và hiện vật. Thăm Bảo tàng Hoàng thành Thăng Long.", "Tìm hiểu về công tác khảo cổ tại Hoàng thành.", new DateTime(2024, 1, 30, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR039", "CATE002", new DateTime(2023, 7, 7, 18, 30, 0, 0, DateTimeKind.Unspecified), "Tour đặc biệt khám phá Hoàng thành Thăng Long vào buổi tối. Ngắm nhìn các công trình được chiếu sáng lung linh, trải nghiệm không khí trang nghiêm và huyền ảo của di tích về đêm. Có các hoạt động tái hiện lịch sử, biểu diễn nghệ thuật truyền thống (tùy theo lịch của Ban quản lý di tích). Tour mang đến góc nhìn mới lạ và hấp dẫn về Hoàng thành.", "1N0D", "LOC006", 30, "Hoàng thành Thăng Long: Đêm huyền ảo tại di sản", 1840000.0m, "Ngày 1: Chiều tối đến Hoàng thành, thăm các khu vực chính dưới ánh đèn, xem các hoạt động biểu diễn (nếu có), nghe kể chuyện lịch sử về đêm.", "Trải nghiệm tham quan Hoàng thành Thăng Long về đêm.", new DateTime(2023, 7, 7, 18, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR040", "CATE011", new DateTime(2024, 4, 15, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour thiết kế dành cho gia đình, giúp trẻ em và người lớn cùng nhau tìm hiểu về lịch sử Hoàng thành Thăng Long một cách vui nhộn và tương tác. Tham gia các trò chơi giáo dục, hoạt động thực tế (như mặc thử trang phục cổ, làm đồ thủ công liên quan), nghe kể chuyện lịch sử bằng hình ảnh, thăm các khu vực phù hợp với trẻ nhỏ. Tạo sự hứng thú và kiến thức bổ ích cho cả gia đình.", "1N0D", "LOC006", 20, "Hoàng thành Thăng Long: Trải nghiệm không gian di sản cho gia đình", 2760000.0m, "Ngày 1: Các hoạt động nhập môn, trò chơi tại khu di tích. Thăm các điểm chính với cách tiếp cận thân thiện với trẻ em. Ăn trưa nhẹ. Buổi chiều: Hoạt động thực hành, tổng kết.", "Tour học mà chơi, phù hợp cho cả gia đình có trẻ nhỏ.", new DateTime(2024, 4, 15, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR041", "CATE016", new DateTime(2023, 2, 10, 10, 0, 0, 0, DateTimeKind.Unspecified), "Thăm Thành nhà Hồ (Thành Tây Đô), Di sản Văn hóa Thế giới tại Thanh Hóa. Đây là tòa thành được xây dựng bằng đá nguyên khối quy mô lớn, minh chứng cho kỹ thuật xây dựng độc đáo đầu thế kỷ 15. Tìm hiểu về lịch sử triều Hồ và ý nghĩa của công trình này. Ngắm nhìn các cổng thành và bức tường đá còn sót lại, chiêm ngưỡng kỹ thuật ghép đá tinh xảo.", "1N0D", "LOC007", 30, "Thành nhà Hồ: Di sản kiến trúc đá cổ", 1380000.0m, "Ngày 1: Di chuyển đến Thành nhà Hồ. Thăm quan 4 cổng thành, các đoạn tường thành còn lại, tìm hiểu lịch sử tại nhà trưng bày. Kết thúc tour buổi trưa/chiều.", "Khám phá tòa thành đá hùng vĩ duy nhất tại Việt Nam.", new DateTime(2023, 2, 10, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR042", "CATE006", new DateTime(2024, 5, 5, 8, 0, 0, 0, DateTimeKind.Unspecified), "Tour kết hợp thăm Thành nhà Hồ (Thanh Hóa) với các điểm du lịch nổi tiếng của Ninh Bình gần đó như Tam Cốc-Bích Động hoặc Tràng An. Buổi sáng thăm Thành nhà Hồ, tìm hiểu lịch sử. Buổi chiều di chuyển sang Ninh Bình để trải nghiệm cảnh quan thiên nhiên hùng vĩ 'Vịnh Hạ Long trên cạn' hoặc các khu tâm linh nổi tiếng. Mang đến sự đa dạng trong một chuyến đi.", "1N0D", "LOC007", 25, "Thành nhà Hồ: Kết hợp di sản và cảnh quan Ninh Bình", 2990000.0m, "Ngày 1: Thăm Thành nhà Hồ. Ăn trưa. Chiều: Di chuyển sang Ninh Bình, thăm Tam Cốc/Tràng An (đi thuyền). Tối: Nghỉ đêm tại Ninh Bình (tùy chọn) hoặc trở về điểm xuất phát.", "Khám phá Thành nhà Hồ và các điểm du lịch Ninh Bình lân cận.", new DateTime(2024, 5, 5, 8, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR043", "CATE002", new DateTime(2023, 10, 1, 9, 30, 0, 0, DateTimeKind.Unspecified), "Tour dành cho những người quan tâm đến kiến trúc và kỹ thuật xây dựng cổ. Tập trung vào việc phân tích cấu trúc, vật liệu, kỹ thuật chế tác và ghép đá khổng lồ để xây dựng Thành nhà Hồ. Có hướng dẫn viên am hiểu về lĩnh vực này, giải thích chi tiết về quy trình xây dựng cách đây 600 năm mà không dùng vật liệu kết dính. So sánh kỹ thuật xây dựng với các công trình đá khác trên thế giới.", "1N0D", "LOC007", 15, "Thành nhà Hồ: Kiến trúc và kỹ thuật xây dựng cổ", 1610000.0m, "Ngày 1: Thăm quan Thành nhà Hồ, tập trung phân tích cấu trúc và kỹ thuật tại các cổng và tường thành. Nghe thuyết minh chuyên sâu. Thảo luận.", "Tìm hiểu chuyên sâu về kỹ thuật xây dựng độc đáo của thành đá.", new DateTime(2023, 10, 1, 9, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR044", "CATE016", new DateTime(2024, 2, 28, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour tập trung vào bối cảnh lịch sử đặc biệt của Thành nhà Hồ và triều đại nhà Hồ. Tìm hiểu về cuộc cải cách của Hồ Quý Ly, sự kiện dời đô từ Thăng Long về Tây Đô, và giai đoạn kháng chiến chống quân Minh. Thăm các điểm di tích phụ cận (nếu có) liên quan đến triều Hồ. Tour mang đến cái nhìn toàn diện về một giai đoạn lịch sử đầy biến động.", "1N0D", "LOC007", 20, "Thành nhà Hồ: Lịch sử và Bối cảnh Triều Hồ", 1495000.0m, "Ngày 1: Thăm Thành nhà Hồ, nghe thuyết minh chi tiết về lịch sử triều Hồ và các sự kiện quan trọng. Thăm nhà trưng bày.", "Tìm hiểu sâu về triều đại ngắn ngủi và cải cách của nhà Hồ.", new DateTime(2024, 2, 28, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR045", "CATE019", new DateTime(2023, 11, 5, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour dành cho những người yêu thích nhiếp ảnh, đưa bạn đến các điểm vantage point xung quanh Thành nhà Hồ để ghi lại những bức ảnh toàn cảnh và chi tiết về kiến trúc đá độc đáo. Có hướng dẫn viên am hiểu về các góc chụp đẹp và thời điểm ánh sáng tốt nhất trong ngày. Phù hợp cho cả người mới bắt đầu và nhiếp ảnh gia chuyên nghiệp muốn ghi lại hình ảnh di sản này.", "1N0D", "LOC007", 10, "Thành nhà Hồ: Ngắm toàn cảnh và chụp ảnh Di sản", 1725000.0m, "Ngày 1: Buổi sáng/chiều thăm Thành nhà Hồ, di chuyển đến các điểm chụp ảnh quanh thành (gần cổng Nam, cổng Bắc, khu vực khai quật...).", "Cơ hội chụp ảnh những góc đẹp nhất của Thành nhà Hồ.", new DateTime(2023, 11, 5, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR046", "CATE006", new DateTime(2022, 6, 15, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour khám phá Quần thể danh thắng Tràng An, Di sản Thế giới hỗn hợp đầu tiên của Việt Nam. Ngồi thuyền truyền thống đi qua các hang động tự nhiên, thung lũng ngập nước và các dãy núi đá vôi hùng vĩ. Thăm các đền, chùa cổ kính nằm giữa thiên nhiên. Trải nghiệm không gian yên bình, thơ mộng và vẻ đẹp non nước hữu tình của Tràng An. Có nhiều tuyến thuyền khác nhau để lựa chọn.", "1N0D", "LOC008", 50, "Tràng An: Du thuyền khám phá Quần thể danh thắng", 2070000.0m, "Ngày 1: Đến bến thuyền Tràng An, lựa chọn tuyến thuyền, bắt đầu hành trình đi thuyền qua hang động, thung lũng, thăm đền, chùa. Kết thúc tour sau khoảng 3-4 tiếng.", "Đi thuyền qua hang động và núi đá vôi kỳ vĩ tại Tràng An.", new DateTime(2022, 6, 15, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR047", "CATE007", new DateTime(2023, 1, 10, 8, 0, 0, 0, DateTimeKind.Unspecified), "Tour kết hợp thăm Chùa Bái Đính, quần thể tâm linh lớn nhất Việt Nam với nhiều kỷ lục. Sau đó, khám phá Quần thể danh thắng Tràng An bằng thuyền. Tour mang đến trải nghiệm đa dạng, từ không gian tâm linh trang nghiêm của chùa Bái Đính đến vẻ đẹp thiên nhiên và các đền thờ cổ kính nằm trong lòng Tràng An. Phù hợp cho những người muốn kết hợp du lịch tâm linh và ngắm cảnh.", "1N0D", "LOC008", 45, "Tràng An: Kết hợp Bái Đính và Tràng An linh thiêng", 2530000.0m, "Ngày 1: Thăm Chùa Bái Đính (đi xe điện). Ăn trưa. Chiều: Đi thuyền khám phá Tràng An. Kết thúc tour vào cuối ngày.", "Hành trình tâm linh và khám phá di sản thiên nhiên.", new DateTime(2023, 1, 10, 8, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR048", "CATE006", new DateTime(2024, 4, 1, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour đạp xe thư giãn khám phá khu vực ngoại vi và vùng lõi của Quần thể danh thắng Tràng An. Đạp xe qua những con đường làng yên bình, cánh đồng lúa xanh mướt hoặc vàng óng (tùy mùa), men theo chân núi đá vôi. Ngắm nhìn cảnh quan nông thôn thanh bình, giao lưu với người dân địa phương. Tour nhẹ nhàng, phù hợp với mọi lứa tuổi và yêu thiên nhiên.", "1N0D", "LOC008", 20, "Tràng An: Đạp xe khám phá vùng lõi di sản", 1955000.0m, "Ngày 1: Bắt đầu đạp xe từ khu vực gần Tràng An, đi qua các làng quê, cánh đồng, dừng chân chụp ảnh và nghỉ ngơi. Ăn trưa tại nhà hàng địa phương.", "Đạp xe qua các làng quê và cánh đồng lúa quanh Tràng An.", new DateTime(2024, 4, 1, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR049", "CATE003", new DateTime(2023, 5, 10, 8, 30, 0, 0, DateTimeKind.Unspecified), "Tour kết hợp khám phá Quần thể danh thắng Tràng An bằng thuyền và chinh phục Hang Múa. Leo bộ lên đỉnh núi Ngọa Long tại Hang Múa để ngắm nhìn toàn cảnh tuyệt đẹp của Tràng An, Tam Cốc và các cánh đồng lúa từ trên cao. Khung cảnh được ví như 'thiên đường sống ảo'. Tour yêu cầu một chút thể lực để leo núi, phù hợp với người yêu thích khám phá và chụp ảnh.", "1N0D", "LOC008", 30, "Tràng An: Thám hiểm hang Múa và view toàn cảnh", 2300000.0m, "Ngày 1: Buổi sáng đi thuyền khám phá Tràng An. Ăn trưa. Chiều: Di chuyển đến Hang Múa, leo núi Ngọa Long. Kết thúc tour.", "Chinh phục hang Múa và ngắm nhìn toàn cảnh Tràng An từ trên cao.", new DateTime(2023, 5, 10, 8, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR050", "CATE004", new DateTime(2024, 1, 1, 14, 0, 0, 0, DateTimeKind.Unspecified), "Tour du lịch nghỉ dưỡng cao cấp tại khu vực Tràng An. Lưu trú tại các resort hoặc homestay sinh thái sang trọng ẩn mình giữa thiên nhiên. Trải nghiệm Tràng An bằng thuyền với dịch vụ riêng hoặc nhóm nhỏ. Tận hưởng không gian yên bình, các bữa ăn đặc sản tinh tế, và các hoạt động thư giãn như spa, yoga giữa khung cảnh núi non. Phù hợp cho cặp đôi hoặc gia đình muốn nghỉ dưỡng và tận hưởng sự riêng tư.", "2N1D", "LOC008", 10, "Tràng An: Du lịch sang trọng và nghỉ dưỡng Eco", 16100000.0m, "Ngày 1: Đến khu nghỉ dưỡng, nhận phòng. Buổi chiều đi thuyền Tràng An theo tuyến riêng. Tối: Ăn tối cao cấp, thư giãn. Ngày 2: Ăn sáng, thư giãn tại resort, có thể tham gia hoạt động nhẹ (yoga/spa). Check-out.", "Trải nghiệm Tràng An đẳng cấp với nghỉ dưỡng và dịch vụ cao cấp.", new DateTime(2024, 1, 20, 11, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR051", "CATE004", new DateTime(2023, 9, 15, 10, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm tại Đà Nẵng kết hợp nghỉ dưỡng tại bãi biển Mỹ Khê xinh đẹp và khám phá thiên nhiên bán đảo Sơn Trà. Tham quan Chùa Linh Ứng với tượng Phật Bà Quan Âm uy nghiêm, chinh phục đỉnh Bàn Cờ để ngắm toàn cảnh thành phố. Thưởng thức hải sản tươi ngon và không khí sôi động của thành phố biển. Phù hợp cho gia đình và cặp đôi.", "3N2D", "LOC011", 30, "Đà Nẵng: Nghỉ dưỡng Biển Mỹ Khê và Khám phá Sơn Trà 3 ngày", 8740000.0m, "Ngày 1: Đến Đà Nẵng, nhận phòng khách sạn gần biển, tắm biển Mỹ Khê. Tối: Dạo cầu Rồng/Cầu Tình Yêu. Ngày 2: Thăm Bán đảo Sơn Trà: Chùa Linh Ứng, đỉnh Bàn Cờ. Chiều: Tự do tắm biển/mua sắm. Ngày 3: Tham quan Ngũ Hành Sơn (nếu còn thời gian), mua sắm đặc sản, ra sân bay.", "Tận hưởng biển Đà Nẵng và vẻ đẹp bán đảo Sơn Trà.", new DateTime(2023, 10, 1, 11, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR052", "CATE002", new DateTime(2024, 1, 25, 9, 30, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm từ Đà Nẵng, đưa bạn lên cáp treo kỷ lục thế giới để khám phá Bà Nà Hills với Cầu Vàng nổi tiếng, Làng Pháp cổ kính và khu vui chơi Fantasy Park. Sau đó, dành thời gian khám phá Phố cổ Hội An trầm mặc, di sản UNESCO. Dạo bộ, đi thuyền sông Hoài, thưởng thức ẩm thực và tìm hiểu văn hóa địa phương. Tour đa dạng trải nghiệm.", "4N3D", "LOC011", 25, "Đà Nẵng: Khám phá Bà Nà Hills và Di sản Hội An 4 ngày", 12650000.0m, "Ngày 1: Đến Đà Nẵng, nhận phòng. Tối: Tự do. Ngày 2: Tham quan Bà Nà Hills cả ngày. Ngày 3: Di chuyển Hội An, thăm phố cổ (Chùa Cầu, nhà cổ, hội quán), đi thuyền/thả đèn hoa đăng. Ngày 4: Buổi sáng Hội An (làng nghề/mua sắm), về Đà Nẵng, ra sân bay.", "Kết hợp trải nghiệm Bà Nà tiên cảnh và phố cổ Hội An.", new DateTime(2024, 2, 10, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR053", "CATE010", new DateTime(2023, 7, 1, 11, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 5 ngày 4 đêm khám phá trọn vẹn Đà Nẵng và các điểm lân cận. Bao gồm thời gian thư giãn tại biển, tham quan các danh thắng như Ngũ Hành Sơn, Bán đảo Sơn Trà, trải nghiệm Bà Nà Hills, và đắm mình trong không gian cổ kính của Hội An. Lịch trình cân bằng giữa nghỉ dưỡng, khám phá thiên nhiên, văn hóa và lịch sử. Phù hợp cho những ai muốn có chuyến đi đầy đủ.", "5N4D", "LOC011", 35, "Đà Nẵng: Hành trình 5 ngày Biển - Núi - Phố cổ", 15640000.0m, "Ngày 1: Đến Đà Nẵng, nhận phòng, tắm biển. Ngày 2: Tham quan Ngũ Hành Sơn, Làng đá Non Nước, Bán đảo Sơn Trà. Ngày 3: Tham quan Bà Nà Hills cả ngày. Ngày 4: Di chuyển Hội An, thăm phố cổ, trải nghiệm ẩm thực/làng nghề. Ngày 5: Mua sắm đặc sản Đà Nẵng, ra sân bay.", "Trải nghiệm toàn diện Đà Nẵng và vùng lân cận.", new DateTime(2023, 7, 20, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR054", "CATE003", new DateTime(2024, 3, 5, 14, 0, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm dành cho người yêu thích phiêu lưu. Trekking và khám phá Vườn quốc gia Bạch Mã (gần Đà Nẵng), vượt suối, ngắm cảnh rừng núi hùng vĩ. Trải nghiệm Zipline hoặc Canyoning tại các khu du lịch mạo hiểm. Có thể kết hợp với leo núi Ngũ Hành Sơn hoặc khám phá các hang động tự nhiên (nếu có). Yêu cầu thể lực tốt. Bao gồm hướng dẫn viên chuyên nghiệp và thiết bị an toàn.", "4N3D", "LOC011", 15, "Đà Nẵng: Tour Phiêu lưu và Trekking 4 ngày", 18400000.0m, "Ngày 1: Đến Đà Nẵng, chuẩn bị. Ngày 2: Trekking Vườn quốc gia Bạch Mã (hoặc khu vực khác), cắm trại/nghỉ tại khu vực. Ngày 3: Tham gia Zipline/Canyoning (hoặc hoạt động mạo hiểm khác). Ngày 4: Hoạt động nhẹ (leo Ngũ Hành Sơn) hoặc thư giãn, ra sân bay.", "Thử thách bản thân với các hoạt động mạo hiểm quanh Đà Nẵng.", new DateTime(2024, 3, 5, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR055", "CATE019", new DateTime(2023, 10, 18, 8, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm dành cho những người đam mê nhiếp ảnh, tập trung vào việc chụp các khoảnh khắc đẹp nhất tại Đà Nẵng và lân cận. Chụp bình minh tại biển Mỹ Khê hoặc Bán đảo Sơn Trà, hoàng hôn tại cầu Rồng hoặc các điểm view đẹp khác. Có thể di chuyển đến Hội An để chụp ảnh phố cổ về đêm. Hướng dẫn viên am hiểu về các điểm chụp ảnh đẹp và thời gian lý tưởng.", "3N2D", "LOC011", 10, "Đà Nẵng: Tour Nhiếp ảnh Bình minh và Hoàng hôn 3 ngày", 10350000.0m, "Ngày 1: Đến Đà Nẵng, nhận phòng. Chiều: Chụp hoàng hôn cầu Rồng/Sông Hàn. Tối: Chụp ảnh đêm thành phố. Ngày 2: Dậy sớm chụp bình minh. Chiều: Chụp ảnh tại Ngũ Hành Sơn/Sơn Trà. Tối: Tự do hoặc di chuyển Hội An chụp ảnh đèn lồng. Ngày 3: Sáng tự do chụp ảnh, ra sân bay.", "Lưu giữ vẻ đẹp Đà Nẵng qua ống kính máy ảnh.", new DateTime(2023, 10, 18, 8, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR056", "CATE001", new DateTime(2022, 7, 20, 11, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm tận hưởng vẻ đẹp biển Nha Trang. Tham quan các đảo nổi tiếng như Hòn Mun (lặn ngắm san hô), Hòn Tằm (tắm bùn, thư giãn), hoặc các đảo khác tùy chọn. Tắm biển Bãi Dài hoặc bãi biển trung tâm. Thưởng thức hải sản tươi sống. Tour kết hợp giữa nghỉ dưỡng và khám phá các điểm đến đặc trưng của vịnh Nha Trang.", "3N2D", "LOC012", 30, "Nha Trang: Thiên đường Biển đảo và Thư giãn 3 ngày", 7360000.0m, "Ngày 1: Đến Nha Trang, nhận phòng, tắm biển. Tối: Dạo phố/Chợ đêm. Ngày 2: Đi thuyền tham quan các đảo (Hòn Mun, Hòn Tằm, Hòn Một...). Hoạt động lặn biển/tắm bùn (tùy chọn). Ngày 3: Thăm Tháp Bà Ponagar, Chợ Đầm (mua sắm), ra sân bay/ga.", "Nghỉ dưỡng, tắm biển và khám phá các đảo nhỏ Nha Trang.", new DateTime(2022, 7, 20, 11, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR057", "CATE006", new DateTime(2023, 12, 10, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm tập trung vào các hoạt động sinh thái và thư giãn. Thăm Khu du lịch Suối khoáng nóng Tháp Bà hoặc I-Resort để tắm bùn, ngâm khoáng phục hồi sức khỏe. Khám phá Đảo Khỉ, Hòn Lao với các loài động vật hoang dã. Có thể kết hợp thăm Vườn quốc gia Hòn Bà (nếu có thời gian). Tour mang đến không gian yên bình và gần gũi với thiên nhiên.", "4N3D", "LOC012", 25, "Nha Trang: Du lịch Sinh thái và Suối khoáng nóng 4 ngày", 10350000.0m, "Ngày 1: Đến Nha Trang, nhận phòng. Tối: Thư giãn. Ngày 2: Thăm Đảo Khỉ (đi cáp treo/thuyền). Chiều: Tắm biển/Tự do. Ngày 3: Tham quan Suối khoáng nóng, trải nghiệm tắm bùn/ngâm khoáng. Ngày 4: Mua sắm, ra sân bay/ga.", "Trải nghiệm thiên nhiên và thư giãn tại các điểm sinh thái Nha Trang.", new DateTime(2023, 12, 25, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR058", "CATE001", new DateTime(2024, 3, 18, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm tập trung vào việc khám phá Vịnh Nha Trang bằng thuyền. Thăm các hòn đảo đẹp trong vịnh như Hòn Tằm với khu tắm bùn khoáng trên đảo, Hòn Mun với khu bảo tồn biển và lặn ngắm san hô. Tận hưởng các hoạt động dưới nước và nghỉ ngơi trên các đảo. Tour mang đến trải nghiệm biển đảo đặc trưng của Nha Trang.", "3N2D", "LOC012", 30, "Nha Trang: Khám phá Vịnh Nha Trang và Hòn Tằm 3 ngày", 8280000.0m, "Ngày 1: Đến Nha Trang, nhận phòng. Chiều: Thăm Hòn Chồng, Chùa Long Sơn. Tối: Tự do. Ngày 2: Đi thuyền tham quan Vịnh: Hòn Mun (lặn/bơi), Hòn Tằm (tắm bùn/thư giãn). Ăn trưa hải sản trên tàu hoặc đảo. Ngày 3: Mua sắm, ra sân bay/ga.", "Đi thuyền khám phá vịnh và nghỉ dưỡng tại Hòn Tằm.", new DateTime(2024, 3, 18, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR059", "CATE016", new DateTime(2023, 8, 5, 14, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm khám phá các di tích lịch sử và văn hóa tại Nha Trang, đặc biệt là di sản của người Chăm. Thăm quần thể Tháp Bà Ponagar cổ kính, tìm hiểu về kiến trúc và tín ngưỡng của Vương quốc Champa xưa. Thăm các điểm văn hóa khác như Chùa Long Sơn với tượng Phật trắng khổng lồ. Tour mang đến góc nhìn sâu sắc về lịch sử và sự đa dạng văn hóa của vùng đất này.", "3N2D", "LOC012", 25, "Nha Trang: Lịch sử và Văn hóa Chăm tại Tháp Bà 3 ngày", 6900000.0m, "Ngày 1: Đến Nha Trang, nhận phòng. Chiều: Thăm Chùa Long Sơn, Nhà thờ Núi. Tối: Tự do. Ngày 2: Thăm Tháp Bà Ponagar, tìm hiểu lịch sử và văn hóa Chăm. Buổi chiều: Tắm biển/thư giãn. Ngày 3: Mua sắm, ra sân bay/ga.", "Tìm hiểu lịch sử và văn hóa cổ tại Nha Trang.", new DateTime(2023, 8, 5, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR060", "CATE014", new DateTime(2024, 2, 1, 10, 30, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm nghỉ dưỡng tại một trong những resort 5 sao hàng đầu tại Nha Trang hoặc khu vực lân cận (như Cam Ranh). Tận hưởng không gian sang trọng, bãi biển riêng, hồ bơi vô cực, các dịch vụ spa, ẩm thực cao cấp. Tour bao gồm thời gian riêng tư tối đa, phù hợp cho những ai muốn một kỳ nghỉ thư giãn tuyệt đối và đẳng cấp.", "4N3D", "LOC012", 10, "Nha Trang: Tour Sang trọng 4 ngày tại Resort 5 sao", 34500000.0m, "Ngày 1: Đến Nha Trang/Cam Ranh, di chuyển đến resort, nhận phòng, thư giãn. Ngày 2: Tự do tận hưởng tiện ích resort (hồ bơi, spa, bãi biển riêng). Ngày 3: Tự do hoặc tham gia hoạt động nhẹ của resort (yoga, thể thao dưới nước). Ngày 4: Thư giãn buổi sáng, check-out, ra sân bay.", "Trải nghiệm kỳ nghỉ đẳng cấp và dịch vụ hoàn hảo.", new DateTime(2024, 2, 1, 10, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR061", "CATE001", new DateTime(2023, 11, 18, 11, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm tại Phú Quốc, hòn đảo lớn nhất Việt Nam. Tắm biển tại các bãi biển nổi tiếng như Bãi Sao, Bãi Trường. Tham quan các điểm du lịch như nhà tù Phú Quốc (di tích lịch sử), Dinh Cậu (ngắm hoàng hôn). Trải nghiệm các khu vui chơi giải trí đẳng cấp quốc tế như VinWonders hoặc Sun World Hòn Thơm. Tour phù hợp cho gia đình và nhóm bạn.", "3N2D", "LOC013", 30, "Phú Quốc: Thiên đường Đảo ngọc và Vui chơi 3 ngày", 11040000.0m, "Ngày 1: Đến Phú Quốc, nhận phòng, tắm biển Bãi Trường. Tối: Dạo chợ đêm Phú Quốc. Ngày 2: Thăm Nam Đảo: Nhà tù Phú Quốc, Bãi Sao. Chiều: Đi cáp treo Hòn Thơm (tùy chọn). Ngày 3: Thăm Dinh Cậu, Chùa Hộ Quốc, mua sắm đặc sản (nước mắm, tiêu, ngọc trai), ra sân bay.", "Tận hưởng bãi biển đẹp và các khu vui chơi hiện đại.", new DateTime(2023, 12, 5, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR062", "CATE006", new DateTime(2024, 4, 8, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm khám phá khu vực Bắc Đảo Phú Quốc còn giữ nét hoang sơ. Thăm Vườn quốc gia Phú Quốc (trekking nhẹ), đi Gành Dầu để ngắm biên giới Campuchia. Thăm Mũi Gành Dầu, đền thờ Nguyễn Trung Trực. Trải nghiệm tắm biển tại Bãi Ông Lang hoặc các bãi biển phía Bắc. Tour phù hợp cho người yêu thiên nhiên và muốn tìm hiểu về phía Bắc Đảo.", "4N3D", "LOC013", 20, "Phú Quốc: Khám phá Bắc Đảo và Rừng nguyên sinh 4 ngày", 12650000.0m, "Ngày 1: Đến Phú Quốc, nhận phòng. Tối: Tự do. Ngày 2: Thăm Bắc Đảo: Vườn quốc gia (trekking nhẹ), Gành Dầu, đền thờ Nguyễn Trung Trực. Ngày 3: Thăm Bãi Ông Lang, tham gia hoạt động biển (tùy chọn: kayak, SUP). Chiều: Thư giãn. Ngày 4: Mua sắm, ra sân bay.", "Tìm hiểu thiên nhiên hoang sơ và các điểm du lịch Bắc Đảo.", new DateTime(2024, 4, 8, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR063", "CATE004", new DateTime(2023, 6, 20, 10, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 5 ngày 4 đêm thư giãn tại Phú Quốc, kết hợp thời gian nghỉ dưỡng thoải mái và chuyến đi khám phá 4 hòn đảo đẹp phía Nam (Hòn Gầm Ghì, Hòn Móng Tay, Hòn Mây Rút Trong, Hòn Mây Rút Ngoài). Lặn ngắm san hô, bơi lội, chụp ảnh tại các hòn đảo nhỏ hoang sơ. Tour mang đến trải nghiệm đa dạng và đủ thời gian để tận hưởng.", "5N4D", "LOC013", 25, "Phú Quốc: Tour 5 ngày Nghỉ dưỡng và Khám phá 4 đảo", 17250000.0m, "Ngày 1: Đến Phú Quốc, nhận phòng, thư giãn/tắm biển. Ngày 2: Tự do nghỉ dưỡng tại resort/khách sạn. Ngày 3: Tour khám phá 4 đảo Nam Phú Quốc (đi cano), lặn ngắm san hô, bơi lội. Ngày 4: Tự do nghỉ dưỡng hoặc mua sắm/tham quan nhẹ nhàng. Ngày 5: Mua sắm đặc sản, ra sân bay.", "Kỳ nghỉ dài hơn kết hợp nghỉ dưỡng và khám phá các đảo phía Nam.", new DateTime(2023, 7, 10, 15, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR064", "CATE014", new DateTime(2024, 1, 5, 14, 30, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm nghỉ dưỡng tại một trong những resort 5 sao hoặc villa biển sang trọng nhất Phú Quốc. Tận hưởng sự riêng tư, dịch vụ hoàn hảo, ẩm thực tinh tế và các tiện ích đẳng cấp. Có thể bao gồm du thuyền riêng ngắm hoàng hôn hoặc các trải nghiệm độc quyền khác. Tour dành cho những người tìm kiếm sự sang trọng, thư giãn tối đa và không gian nghỉ dưỡng biệt lập.", "4N3D", "LOC013", 8, "Phú Quốc: Tour Sang trọng 4 ngày tại Resort Đẳng cấp", 57500000.0m, "Ngày 1: Đến Phú Quốc, di chuyển đến resort/villa, nhận phòng, thư giãn. Ngày 2: Tự do tận hưởng tiện ích và bãi biển riêng của resort. Ngày 3: Tự do hoặc tham gia hoạt động của resort, có thể đặt bữa tối lãng mạn riêng. Ngày 4: Thư giãn buổi sáng, check-out, ra sân bay.", "Trải nghiệm kỳ nghỉ xa hoa tại đảo ngọc Phú Quốc.", new DateTime(2024, 1, 5, 14, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR065", "CATE005", new DateTime(2023, 5, 8, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm tập trung vào trải nghiệm ẩm thực và tìm hiểu cuộc sống địa phương tại Phú Quốc. Thăm các nhà thùng nước mắm truyền thống, vườn tiêu, cơ sở nuôi cấy ngọc trai. Thưởng thức hải sản tươi sống tại làng chài Hàm Ninh hoặc chợ đêm. Tham gia lớp học nấu ăn món Phú Quốc (tùy chọn). Tour mang đến cái nhìn chân thực về văn hóa và đặc sản của đảo.", "3N2D", "LOC013", 20, "Phú Quốc: Tour Ẩm thực và Cuộc sống địa phương 3 ngày", 9200000.0m, "Ngày 1: Đến Phú Quốc, nhận phòng. Chiều: Thăm nhà thùng nước mắm, vườn tiêu. Tối: Ăn tối hải sản. Ngày 2: Buổi sáng thăm Làng chài Hàm Ninh/Chợ đêm. Chiều: Thăm cơ sở nuôi cấy ngọc trai. Tối: Tự do khám phá ẩm thực. Ngày 3: Mua sắm đặc sản, ra sân bay.", "Khám phá hương vị đặc trưng và đời sống dân dã Phú Quốc.", new DateTime(2023, 5, 8, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR066", "CATE009", new DateTime(2022, 10, 10, 10, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm khám phá Đà Lạt, thành phố của ngàn hoa và sương mù. Thăm các điểm du lịch nổi tiếng như Hồ Xuân Hương, Thung Lũng Tình Yêu, Vườn hoa Thành phố, Thiền viện Trúc Lâm, Dinh Bảo Đại. Ngắm nhìn kiến trúc Pháp cổ kính, tận hưởng không khí trong lành và lãng mạn. Tour phù hợp cho cặp đôi và gia đình.", "3N2D", "LOC014", 35, "Đà Lạt: Thành phố Ngàn hoa và Cảnh quan 3 ngày", 6440000.0m, "Ngày 1: Đến Đà Lạt, nhận phòng. Chiều: Thăm Hồ Xuân Hương, Vườn hoa Thành phố. Tối: Dạo chợ đêm Đà Lạt. Ngày 2: Thăm Dinh Bảo Đại, Thiền viện Trúc Lâm, Hồ Tuyền Lâm. Chiều: Thung Lũng Tình Yêu hoặc Vườn dâu. Ngày 3: Thăm Ga Đà Lạt cổ, Nhà thờ Con Gà, mua sắm đặc sản, ra sân bay/bến xe.", "Khám phá vẻ đẹp lãng mạn và kiến trúc độc đáo Đà Lạt.", new DateTime(2022, 10, 10, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR067", "CATE003", new DateTime(2024, 3, 10, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm dành cho những người yêu thích mạo hiểm thực sự. Tham gia hoạt động Canyoning (vượt thác bằng dây) tại khu vực thác Datanla hoặc một thác khác phù hợp. Trải nghiệm đi bộ trong rừng, leo vách đá, trượt thác tự nhiên, đu dây qua thác. Tour yêu cầu thể lực và tinh thần thép. Bao gồm hướng dẫn viên chuyên nghiệp, thiết bị an toàn và bảo hiểm.", "3N2D", "LOC014", 12, "Đà Lạt: Phiêu lưu Canyoning Vượt thác 3 ngày", 13800000.0m, "Ngày 1: Đến Đà Lạt, nhận phòng. Buổi chiều: Chuẩn bị và làm quen với thiết bị. Tối: Nghỉ ngơi. Ngày 2: Tham gia tour Canyoning cả ngày. Tối: Thư giãn, hồi phục. Ngày 3: Buổi sáng tự do hoặc tham quan nhẹ nhàng, ra sân bay/bến xe.", "Thử thách bản thân với hoạt động Canyoning mạo hiểm.", new DateTime(2024, 3, 10, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR068", "CATE015", new DateTime(2023, 5, 20, 10, 30, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm tìm hiểu về nông nghiệp công nghệ cao phát triển mạnh mẽ tại Đà Lạt và thưởng thức ẩm thực địa phương. Thăm các trang trại trồng dâu, rau sạch, hoa theo mô hình hiện đại. Tìm hiểu quy trình sản xuất và thưởng thức sản phẩm tươi ngon. Tham gia các tour ẩm thực đường phố hoặc lớp nấu ăn (tùy chọn). Tour kết hợp giữa nông nghiệp và ẩm thực.", "4N3D", "LOC014", 20, "Đà Lạt: Tour Ẩm thực và Nông nghiệp Công nghệ cao 4 ngày", 8740000.0m, "Ngày 1: Đến Đà Lạt, nhận phòng. Chiều: Thăm Vườn dâu/Trang trại rau sạch. Tối: Thăm chợ đêm, thử các món ăn đường phố. Ngày 2: Thăm Khu du lịch nông nghiệp công nghệ cao (nếu có). Buổi chiều: Thăm Vườn hoa Vạn Thành/Làng hoa Thái Phiên. Ngày 3: Thăm đồi chè Cầu Đất (nếu có thời gian), Nhà máy chè cổ. Chiều: Tự do mua sắm/thư giãn. Ngày 4: Mua sắm đặc sản, ra sân bay/bến xe.", "Khám phá nông nghiệp hiện đại và ẩm thực Đà Lạt.", new DateTime(2023, 6, 1, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR069", "CATE012", new DateTime(2023, 11, 1, 8, 0, 0, 0, DateTimeKind.Unspecified), "Thiết kế riêng cho các cặp đôi, tour 3 ngày 2 đêm mang đến không gian lãng mạn và những trải nghiệm đáng nhớ tại Đà Lạt. Lưu trú tại homestay/villa lãng mạn, dạo quanh Hồ Xuân Hương, Thung Lũng Tình Yêu, ngắm hoàng hôn từ đồi thông. Có thể bao gồm bữa tối lãng mạn, chụp ảnh cưới (pre-wedding) hoặc các hoạt động riêng tư khác. Tour tập trung vào sự lãng mạn và riêng tư.", "3N2D", "LOC014", 10, "Đà Lạt: Tour Lãng mạn cho Cặp đôi 3 ngày", 16100000.0m, "Ngày 1: Đến Đà Lạt, nhận phòng homestay/villa lãng mạn. Chiều: Dạo Hồ Xuân Hương, Quảng trường Lâm Viên. Tối: Ăn tối lãng mạn. Ngày 2: Thăm Thung Lũng Tình Yêu/Đồi thông 2 mộ (tùy chọn), Cafe với view đẹp. Chiều: Tự do hoặc chụp ảnh lãng mạn. Ngày 3: Mua sắm quà, ra sân bay/bến xe.", "Không gian ngọt ngào và trải nghiệm lãng mạn tại Đà Lạt.", new DateTime(2023, 11, 1, 8, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR070", "CATE003", new DateTime(2024, 4, 20, 9, 30, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm dành cho những người yêu thích trekking và khám phá thiên nhiên. Đi bộ xuyên qua các khu rừng thông bạt ngàn, vượt qua các con suối và ghé thăm các thác nước hùng vĩ ít người biết đến quanh Đà Lạt. Có thể bao gồm cắm trại qua đêm trong rừng hoặc nghỉ tại homestay bản địa. Tour yêu cầu thể lực tốt. Bao gồm hướng dẫn viên địa phương am hiểu địa hình và hệ sinh thái.", "4N3D", "LOC014", 15, "Đà Lạt: Trekking Rừng và Thác nước 4 ngày", 20700000.0m, "Ngày 1: Đến Đà Lạt, chuẩn bị. Ngày 2: Bắt đầu cung trekking (ví dụ: Bidoup Núi Bà hoặc khu vực khác), ăn trưa picnic, cắm trại/nghỉ đêm. Ngày 3: Tiếp tục trekking, khám phá thác nước, về lại điểm xuất phát hoặc nghỉ tại bản. Ngày 4: Thư giãn, mua sắm (nếu còn thời gian), ra sân bay/bến xe.", "Khám phá thiên nhiên hoang sơ qua các cung đường trekking.", new DateTime(2024, 4, 20, 9, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR071", "CATE003", new DateTime(2023, 9, 1, 10, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm trekking qua các bản làng nổi tiếng của Sa Pa như Cát Cát, Lao Chải, Tả Van, Bản Hồ. Ngắm nhìn những thửa ruộng bậc thang hùng vĩ, khám phá phong tục tập quán, trang phục truyền thống và đời sống sinh hoạt của các dân tộc thiểu số (H'Mông, Dao, Tày...). Nghỉ đêm tại homestay bản địa để trải nghiệm chân thực. Tour văn hóa và sinh thái.", "3N2D", "LOC015", 25, "Sa Pa: Trekking Bản làng và Văn hóa dân tộc 3 ngày", 8050000.0m, "Ngày 1: Đến Sa Pa, nhận phòng. Chiều: Trekking bản Cát Cát. Tối: Thăm thị trấn Sa Pa. Ngày 2: Trekking Lao Chải - Tả Van, ngắm ruộng bậc thang, nghỉ đêm tại homestay bản Tả Van. Ngày 3: Trekking từ Tả Van về, thăm bản khác (nếu có), về Sa Pa, mua sắm, ra ga/bến xe.", "Đi bộ qua các bản làng, tìm hiểu đời sống người dân tộc.", new DateTime(2023, 9, 1, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR072", "CATE003", new DateTime(2024, 1, 12, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm kết hợp chinh phục Fansipan - 'Nóc nhà Đông Dương' (bằng cáp treo hoặc trekking - tùy chọn tour cụ thể) và khám phá cảnh quan Sa Pa. Ngắm nhìn toàn cảnh dãy Hoàng Liên Sơn và thung lũng Mường Hoa từ trên cao. Thăm các điểm như Hàm Rồng, Nhà thờ đá. Có thời gian nghỉ ngơi và tận hưởng không khí núi rừng.", "4N3D", "LOC015", 20, "Sa Pa: Chinh phục Fansipan và Ngắm cảnh 4 ngày", 14950000.0m, "Ngày 1: Đến Sa Pa, nhận phòng. Chiều: Thăm Núi Hàm Rồng, Nhà thờ đá. Tối: Tự do. Ngày 2: Chinh phục Fansipan (đi cáp treo). Ngày 3: Trekking nhẹ nhàng đến thung lũng Mường Hoa, ngắm cảnh ruộng bậc thang. Ngày 4: Mua sắm tại chợ Sa Pa, ra ga/bến xe.", "Trải nghiệm đỉnh Fansipan và cảnh sắc Sa Pa hùng vĩ.", new DateTime(2024, 1, 12, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR073", "CATE019", new DateTime(2023, 9, 10, 8, 30, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm đặc biệt dành cho người yêu nhiếp ảnh vào mùa lúa chín (khoảng tháng 9-10). Đưa bạn đến những góc chụp đẹp nhất của ruộng bậc thang tại thung lũng Mường Hoa, Lao Chải, Tả Van, hoặc xa hơn như Y Tý (nếu tour nâng cao). Chụp ảnh bình minh/hoàng hôn trên ruộng, hình ảnh người dân địa phương làm việc. Hướng dẫn viên am hiểu về địa điểm và ánh sáng chụp ảnh.", "3N2D", "LOC015", 10, "Sa Pa: Tour Chụp ảnh Mùa vàng Ruộng bậc thang 3 ngày", 11040000.0m, "Ngày 1: Đến Sa Pa, nhận phòng. Chiều: Chụp ảnh tại thung lũng Mường Hoa. Tối: Chụp ảnh thị trấn về đêm. Ngày 2: Dậy sớm di chuyển đến Lao Chải/Tả Van để chụp bình minh ruộng bậc thang. Chiều: Tiếp tục chụp ảnh tại các điểm view khác. Ngày 3: Sáng chụp ảnh, mua sắm, ra ga/bến xe.", "Ghi lại khoảnh khắc tuyệt đẹp của ruộng bậc thang Sa Pa.", new DateTime(2023, 9, 10, 8, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR074", "CATE002", new DateTime(2023, 4, 5, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm kết hợp trekking nhẹ nhàng qua các bản làng quanh Sa Pa với việc tham quan các chợ phiên nổi tiếng của các dân tộc vùng cao như chợ phiên Bắc Hà (Chủ Nhật), chợ phiên Cốc Ly (Thứ Ba), hoặc chợ phiên khác tùy ngày khởi hành. Trải nghiệm không khí tấp nập, độc đáo của chợ phiên, mua sắm thổ cẩm, đồ thủ công và thưởng thức ẩm thực địa phương. Tour văn hóa sâu sắc.", "4N3D", "LOC015", 20, "Sa Pa: Kết hợp Bản làng và chợ phiên vùng cao 4 ngày", 9660000.0m, "Ngày 1: Đến Sa Pa, nhận phòng. Chiều: Thăm bản Cát Cát. Tối: Tự do. Ngày 2: Di chuyển tham quan chợ phiên (phù hợp với ngày trong tuần). Ngày 3: Trekking nhẹ nhàng đến Lao Chải - Tả Van, thăm bản, nghỉ ngơi. Ngày 4: Về lại Sa Pa, mua sắm, ra ga/bến xe.", "Khám phá văn hóa đa dạng qua các chợ phiên độc đáo.", new DateTime(2023, 4, 5, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR075", "CATE004", new DateTime(2024, 2, 20, 14, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm nghỉ dưỡng tại các resort hoặc khách sạn boutique cao cấp tại Sa Pa hoặc khu vực thung lũng Mường Hoa. Tận hưởng không gian yên tĩnh, view núi non hùng vĩ và ruộng bậc thang tuyệt đẹp. Dịch vụ spa, ẩm thực tinh tế, và các hoạt động nhẹ nhàng như yoga, thiền, tản bộ quanh khu nghỉ dưỡng. Phù hợp cho những ai muốn một kỳ nghỉ thư thái và sang trọng giữa thiên nhiên.", "3N2D", "LOC015", 10, "Sa Pa: Nghỉ dưỡng Sang trọng giữa núi rừng 3 ngày", 18400000.0m, "Ngày 1: Đến Sa Pa, di chuyển đến resort, nhận phòng, thư giãn. Ngày 2: Tự do tận hưởng tiện ích resort, có thể tham gia tản bộ nhẹ nhàng hoặc spa. Ngày 3: Thư giãn buổi sáng, check-out, ra ga/bến xe.", "Thư giãn và tận hưởng không khí trong lành tại Sa Pa.", new DateTime(2024, 2, 20, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR076", "CATE001", new DateTime(2022, 8, 25, 10, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm tại Mũi Né, Phan Thiết. Thư giãn tại bãi biển, tắm nắng, bơi lội. Khám phá Đồi Cát Đỏ (đồi Cát Bay) và Đồi Cát Trắng (tiểu sa mạc Sahara Việt Nam), trải nghiệm trượt cát hoặc đi xe Jeep/ATV. Thăm Làng Chài Mũi Né, Suối Tiên (Suối Hồng). Tour kết hợp nghỉ dưỡng biển và khám phá cảnh quan độc đáo.", "3N2D", "LOC016", 30, "Mũi Né: Biển Xanh, Cát Đỏ và Resort 3 ngày", 6900000.0m, "Ngày 1: Đến Mũi Né, nhận phòng resort, tắm biển. Tối: Dạo phố. Ngày 2: Sáng sớm ngắm bình minh Đồi Cát Trắng, trải nghiệm trượt cát/xe địa hình. Buổi chiều: Thăm Suối Tiên, Làng chài, ngắm hoàng hôn Đồi Cát Đỏ. Ngày 3: Thư giãn, mua sắm đặc sản (nước mắm, thanh long), ra ga/bến xe.", "Tận hưởng bãi biển và khám phá đồi cát đặc trưng Mũi Né.", new DateTime(2022, 8, 25, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR077", "CATE008", new DateTime(2023, 3, 1, 9, 30, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm dành cho những người yêu thích thể thao dưới nước. Mũi Né là điểm đến lý tưởng cho lướt ván diều (kitesurfing) và lướt ván buồm (windsurfing). Tham gia các buổi học cơ bản hoặc nâng cao với hướng dẫn viên chuyên nghiệp. Bên cạnh đó là thời gian thư giãn tại resort, tận hưởng không khí biển trong lành. Tour kết hợp thể thao và nghỉ dưỡng.", "4N3D", "LOC016", 15, "Mũi Né: Tour Thể thao Biển và Nghỉ dưỡng 4 ngày", 16100000.0m, "Ngày 1: Đến Mũi Né, nhận phòng. Chiều: Làm quen với bãi biển, chuẩn bị. Ngày 2: Tham gia buổi học lướt ván (sáng/chiều tùy điều kiện gió). Ngày 3: Tiếp tục luyện tập lướt ván hoặc tự do tắm biển/thư giãn. Ngày 4: Thư giãn buổi sáng, mua sắm, ra ga/bến xe.", "Trải nghiệm lướt ván diều/buồm và thư giãn tại Mũi Né.", new DateTime(2023, 3, 1, 9, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR078", "CATE006", new DateTime(2024, 4, 12, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm tập trung khám phá khu vực Bàu Trắng và Đồi Cát Trắng rộng lớn, được mệnh danh là 'Tiểu sa mạc Sahara của Việt Nam'. Ngắm cảnh Bàu Sen (hồ sen giữa đồi cát), trải nghiệm đi xe địa hình (ATV) chinh phục cồn cát. Có thể kết hợp thăm Hải đăng Kê Gà (gần đó) hoặc các điểm du lịch khác của Phan Thiết. Tour thiên nhiên và phiêu lưu nhẹ.", "3N2D", "LOC016", 25, "Mũi Né: Khám phá Đồi cát và Bàu Trắng 3 ngày", 8050000.0m, "Ngày 1: Đến Mũi Né, nhận phòng. Chiều: Thăm Đồi Cát Đỏ, Làng chài. Tối: Tự do. Ngày 2: Sáng sớm di chuyển Bàu Trắng/Đồi Cát Trắng, trải nghiệm xe địa hình, ngắm cảnh Bàu Sen. Buổi chiều: Thư giãn tại resort/tắm biển. Ngày 3: Thư giãn, mua sắm, ra ga/bến xe.", "Du ngoạn trên những cồn cát trắng trải dài như sa mạc.", new DateTime(2024, 4, 12, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR079", "CATE014", new DateTime(2023, 10, 25, 14, 30, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm dành cho những người yêu thích golf và nghỉ dưỡng sang trọng. Lưu trú tại các resort cao cấp có sân golf riêng hoặc gần sân golf nổi tiếng. Dành thời gian chơi golf trên sân tiêu chuẩn quốc tế, sau đó thư giãn tại resort, tận hưởng bãi biển và các dịch vụ spa. Tour kết hợp thể thao, nghỉ dưỡng và sang trọng.", "4N3D", "LOC016", 10, "Mũi Né: Nghỉ dưỡng Sang trọng và Golf 4 ngày", 41400000.0m, "Ngày 1: Đến Mũi Né, nhận phòng resort, thư giãn. Ngày 2: Chơi golf tại sân golf (sáng), chiều thư giãn tại resort. Ngày 3: Chơi golf (tùy chọn) hoặc tự do tận hưởng tiện ích resort, tắm biển. Ngày 4: Thư giãn buổi sáng, check-out, ra ga/bến xe.", "Kỳ nghỉ đẳng cấp kết hợp chơi golf và thư giãn biển.", new DateTime(2023, 10, 25, 14, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR080", "CATE005", new DateTime(2024, 1, 1, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm kết hợp trải nghiệm ẩm thực hải sản tươi ngon tại Mũi Né và tìm hiểu về văn hóa của đồng bào Chăm tại tỉnh Bình Thuận. Thăm Làng Chài Mũi Né, thưởng thức các món hải sản đặc trưng. Ghé thăm Tháp Po Sah Inu, một di tích Chăm cổ nằm trên đồi Bà Nài. Tìm hiểu về phong tục, tín ngưỡng và nghệ thuật của người Chăm. Tour kết hợp ẩm thực và văn hóa.", "3N2D", "LOC016", 20, "Mũi Né: Tour Ẩm thực Hải sản và Văn hóa Chăm 3 ngày", 7360000.0m, "Ngày 1: Đến Mũi Né, nhận phòng. Chiều: Thăm Tháp Po Sah Inu, tìm hiểu văn hóa Chăm. Tối: Thưởng thức hải sản tại Làng chài hoặc nhà hàng. Ngày 2: Thư giãn tại bãi biển. Buổi chiều: Thăm Đồi Cát Đỏ, Suối Tiên. Ngày 3: Mua sắm đặc sản, ra ga/bến xe.", "Thưởng thức hải sản và tìm hiểu văn hóa Chăm Bình Thuận.", new DateTime(2024, 1, 1, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR081", "CATE017", new DateTime(2023, 7, 15, 8, 30, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm khám phá Cần Thơ, thủ phủ miền Tây sông nước. Đi thuyền tham quan Chợ nổi Cái Răng - một trong những chợ nổi lớn nhất Đồng bằng sông Cửu Long vào buổi sáng sớm. Thăm các làng nghề truyền thống ven sông như làm hủ tiếu, làm cốm. Điền thuyền qua các kênh rạch nhỏ, thăm vườn cây ăn trái, tìm hiểu về cuộc sống và văn hóa của người dân miền Tây.", "3N2D", "LOC017", 35, "Cần Thơ: Chợ nổi Cái Răng và Cuộc sống Sông nước 3 ngày", 6440000.0m, "Ngày 1: Đến Cần Thơ, nhận phòng. Chiều: Thăm Chùa Ông, Bến Ninh Kiều. Tối: Dạo bến Ninh Kiều/Cầu Cần Thơ. Ngày 2: Sáng sớm đi thuyền chợ nổi Cái Răng, thăm làng nghề hủ tiếu/cốm. Chiều: Thăm Vườn cây ăn trái (Mỹ Khánh hoặc khác), nghe đờn ca tài tử (tùy chọn). Ngày 3: Mua sắm đặc sản, ra sân bay/bến xe.", "Trải nghiệm chợ nổi sầm uất và đời sống bình dị miền Tây.", new DateTime(2023, 7, 15, 8, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR082", "CATE006", new DateTime(2024, 4, 28, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm tập trung vào du lịch sinh thái tại Cần Thơ, đặc biệt là khu vực Cồn Sơn - một cù lao nhỏ yên bình trên sông Hậu. Khám phá Cồn Sơn với mô hình du lịch cộng đồng, trải nghiệm làm bánh xèo, xem cá lóc bay, thăm vườn trái cây. Kết hợp thăm các vườn trái cây lớn khác hoặc khu du lịch sinh thái khác quanh Cần Thơ. Tour mang đến không gian yên bình, gần gũi thiên nhiên.", "3N2D", "LOC017", 25, "Cần Thơ: Du lịch Sinh thái Cồn Sơn và Miệt vườn 3 ngày", 7360000.0m, "Ngày 1: Đến Cần Thơ, nhận phòng. Chiều: Thăm Bến Ninh Kiều. Tối: Tự do. Ngày 2: Đi thuyền ra Cồn Sơn, trải nghiệm các hoạt động sinh thái (làm bánh, xem cá bay, thăm vườn). Ăn trưa tại Cồn Sơn. Chiều: Về lại đất liền, thư giãn. Ngày 3: Thăm Chợ Cần Thơ, mua sắm, ra sân bay/bến xe.", "Khám phá Cồn Sơn và trải nghiệm sinh thái miệt vườn.", new DateTime(2024, 4, 28, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR083", "CATE005", new DateTime(2023, 11, 10, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm dành cho tín đồ ẩm thực, tập trung vào khám phá và trải nghiệm các món ăn đặc sắc của miền Tây tại Cần Thơ và các tỉnh lân cận (nếu có thời gian di chuyển). Thăm các khu chợ truyền thống, tìm hiểu về nguyên liệu và cách chế biến. Tham gia các lớp học nấu ăn món miền Tây, thưởng thức các món đặc sản như lẩu mắm, bánh xèo, nem nướng, trái cây. Tour ẩm thực chuyên sâu.", "4N3D", "LOC017", 15, "Cần Thơ: Tour Ẩm thực Miền Tây 4 ngày", 10350000.0m, "Ngày 1: Đến Cần Thơ, nhận phòng. Chiều/Tối: Khám phá ẩm thực đường phố Cần Thơ. Ngày 2: Sáng sớm đi chợ nổi (thử món ăn trên thuyền), thăm làng nghề (hủ tiếu, bánh hỏi). Trưa: Ăn trưa món đặc sản. Chiều: Thăm vườn cây trái (thưởng thức tại vườn). Tối: Thưởng thức lẩu mắm hoặc món khác. Ngày 3: Tham gia lớp học nấu ăn món miền Tây. Chiều: Tự do khám phá thêm. Ngày 4: Mua sắm đặc sản ẩm thực, ra sân bay/bến xe.", "Hành trình khám phá hương vị độc đáo của ẩm thực miền Tây.", new DateTime(2023, 11, 10, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR084", "CATE004", new DateTime(2024, 1, 20, 14, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm trải nghiệm nghỉ dưỡng tại các homestay ven sông tại Cần Thơ hoặc các cù lao yên bình. Hòa mình vào cuộc sống của người dân địa phương, tham gia các hoạt động hàng ngày như đi chợ nổi, bơi xuồng trong kênh rạch, bắt cá (tùy homestay), học làm các món ăn đơn giản. Tận hưởng không khí trong lành, yên tĩnh và sự hiếu khách của người miền Tây. Phù hợp cho người muốn tìm kiếm sự bình yên và trải nghiệm văn hóa địa phương chân thực.", "3N2D", "LOC017", 15, "Cần Thơ: Nghỉ dưỡng Homestay Sông nước 3 ngày", 8050000.0m, "Ngày 1: Đến Cần Thơ, di chuyển đến homestay, nhận phòng, nghỉ ngơi. Chiều: Đi bộ/đạp xe quanh làng. Tối: Ăn tối cùng gia đình chủ nhà, nghe kể chuyện. Ngày 2: Sáng sớm đi thuyền chợ nổi. Buổi sáng: Tham gia hoạt động tại homestay/vườn (làm vườn, câu cá). Chiều: Đi thuyền khám phá kênh rạch xung quanh. Ngày 3: Ăn sáng, thư giãn, chia tay gia đình chủ nhà, ra sân bay/bến xe.", "Trải nghiệm cuộc sống dân dã và yên bình tại homestay.", new DateTime(2024, 1, 20, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR085", "CATE002", new DateTime(2023, 9, 25, 10, 30, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm kết hợp khám phá Cần Thơ và mở rộng hành trình đến Sóc Trăng để tìm hiểu về văn hóa đặc sắc của đồng bào Khmer. Tại Cần Thơ, thăm chợ nổi, miệt vườn. Tại Sóc Trăng, thăm các chùa Khmer nổi tiếng (Chùa Dơi, Chùa Đất Sét, Chùa Chén Kiểu), tìm hiểu về kiến trúc và đời sống văn hóa của người Khmer. Tour đa dạng về văn hóa và cảnh quan miền Tây.", "4N3D", "LOC017", 25, "Cần Thơ: Tour 4 ngày Kết hợp Cần Thơ - Sóc Trăng", 9200000.0m, "Ngày 1: Đến Cần Thơ, thăm Bến Ninh Kiều. Ngày 2: Sáng sớm đi chợ nổi Cái Răng, thăm làng nghề. Chiều: Thăm Vườn cây ăn trái. Ngày 3: Di chuyển Sóc Trăng, thăm các chùa Khmer nổi tiếng. Chiều: Thăm Bảo tàng Khmer (tùy chọn). Tối: Về lại Cần Thơ hoặc nghỉ đêm Sóc Trăng (tùy tour). Ngày 4: Mua sắm đặc sản, ra sân bay/bến xe.", "Khám phá Cần Thơ và văn hóa Khmer tại Sóc Trăng.", new DateTime(2023, 9, 25, 10, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR086", "CATE006", new DateTime(2023, 8, 12, 11, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm khám phá Buôn Ma Thuột, thủ phủ cà phê của Việt Nam. Thăm Bảo tàng Cà phê Thế giới, các vườn cà phê (vào mùa), tìm hiểu quy trình trồng trọt và chế biến. Ghé thăm các thác nước hùng vĩ nổi tiếng như Thác Dray Nur, Thác Dray Sáp. Tìm hiểu về văn hóa các dân tộc thiểu số Tây Nguyên. Tour kết hợp nông nghiệp, sinh thái và văn hóa.", "3N2D", "LOC018", 30, "Buôn Ma Thuột: Thủ phủ Cà phê và Các Thác nước 3 ngày", 6900000.0m, "Ngày 1: Đến Buôn Ma Thuột, nhận phòng. Chiều: Thăm Bảo tàng Cà phê Thế giới, thưởng thức cà phê. Tối: Tự do. Ngày 2: Thăm các thác nước: Dray Nur, Dray Sáp (có thể đi cầu treo). Buổi chiều: Thăm Làng cà phê Trung Nguyên hoặc một vườn cà phê. Ngày 3: Thăm Chùa Sắc Tứ Khải Đoan, mua sắm đặc sản (cà phê, bơ...), ra sân bay.", "Khám phá vùng đất đỏ Bazan và hương vị cà phê.", new DateTime(2023, 8, 12, 11, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR087", "CATE002", new DateTime(2024, 3, 8, 9, 30, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm tập trung vào khám phá văn hóa của các dân tộc thiểu số tại Tây Nguyên, xung quanh Buôn Ma Thuột. Thăm các buôn làng của người Ê Đê, M'Nông. Tìm hiểu về nhà sàn, kiến trúc, phong tục tập quán, trang phục truyền thống. Đặc biệt, trải nghiệm Không gian Văn hóa Cồng Chiêng Tây Nguyên (Di sản UNESCO) qua các buổi biểu diễn và giao lưu. Tour văn hóa chuyên sâu và trải nghiệm.", "4N3D", "LOC018", 20, "Buôn Ma Thuột: Văn hóa Cồng Chiêng và Bản làng Tây Nguyên 4 ngày", 9660000.0m, "Ngày 1: Đến Buôn Ma Thuột, nhận phòng. Chiều: Thăm Bảo tàng Dân tộc Đắk Lắk. Tối: Tự do. Ngày 2: Thăm Buôn Đôn (cầu treo, nhà cổ, mộ Vua Voi). Buổi chiều: Thăm một buôn làng khác, tìm hiểu về nhà dài, nghề dệt thổ cẩm. Ngày 3: Trải nghiệm Không gian Văn hóa Cồng Chiêng (biểu diễn cồng chiêng, ăn cơm lam, uống rượu cần). Ngày 4: Mua sắm đặc sản, ra sân bay.", "Tìm hiểu sâu về văn hóa đặc sắc của các dân tộc Tây Nguyên.", new DateTime(2024, 3, 8, 9, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR088", "CATE003", new DateTime(2023, 10, 5, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm dành cho người yêu thích phiêu lưu và khám phá thiên nhiên. Trekking trong Vườn quốc gia Yok Đôn (gần Buôn Ma Thuột), tìm hiểu về hệ thực vật và động vật (có thể thấy Voi hoang dã nếu may mắn). Khám phá các thác nước hùng vĩ và hoang sơ. Có thể bao gồm cắm trại trong rừng hoặc ngủ tại trạm kiểm lâm. Tour yêu cầu thể lực tốt. Bao gồm hướng dẫn viên vườn quốc gia.", "3N2D", "LOC018", 15, "Buôn Ma Thuột: Phiêu lưu Vườn quốc gia và Thác nước 3 ngày", 16100000.0m, "Ngày 1: Đến Buôn Ma Thuột, chuẩn bị. Ngày 2: Di chuyển đến Vườn quốc gia Yok Đôn, bắt đầu trekking, thăm thác nước trong vườn, cắm trại/nghỉ đêm. Ngày 3: Tiếp tục trekking nhẹ nhàng hoặc tham gia hoạt động khác (như đạp xe), về lại Buôn Ma Thuột, ra sân bay.", "Trekking, khám phá hệ sinh thái đa dạng của Tây Nguyên.", new DateTime(2023, 10, 5, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR089", "CATE004", new DateTime(2024, 2, 18, 14, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm nghỉ dưỡng tại các resort hoặc homestay yên tĩnh giữa vườn cà phê hoặc gần các thác nước tại Buôn Ma Thuột. Tận hưởng không gian trong lành, yên bình của cao nguyên. Thăm các quán cà phê đẹp và độc đáo, thưởng thức hương vị cà phê Tây Nguyên nguyên bản. Tour phù hợp cho người muốn tìm kiếm sự thư giãn và không gian yên tĩnh.", "3N2D", "LOC018", 15, "Buôn Ma Thuột: Nghỉ dưỡng Cao nguyên và Cà phê 3 ngày", 11500000.0m, "Ngày 1: Đến Buôn Ma Thuột, di chuyển đến khu nghỉ dưỡng, nhận phòng, thư giãn. Chiều: Thăm một quán cà phê đẹp. Ngày 2: Thư giãn tại khu nghỉ dưỡng hoặc tham gia hoạt động nhẹ nhàng (tản bộ vườn cà phê, thăm thác gần đó). Tối: Thưởng thức ẩm thực địa phương. Ngày 3: Thư giãn buổi sáng, check-out, ra sân bay.", "Thư giãn và tận hưởng không khí trong lành trên cao nguyên.", new DateTime(2024, 2, 18, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR090", "CATE016", new DateTime(2023, 6, 10, 10, 30, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm tập trung vào việc tìm hiểu lịch sử chiến tranh Việt Nam qua các di tích tại Buôn Ma Thuột và khu vực Tây Nguyên. Thăm Bảo tàng Chiến thắng Buôn Ma Thuột, các cứ điểm lịch sử quan trọng (nếu có). Kết hợp thăm các buôn làng để tìm hiểu về cuộc sống của người dân trong chiến tranh và hiện tại. Tour mang tính giáo dục và lịch sử sâu sắc.", "3N2D", "LOC018", 25, "Buôn Ma Thuột: Lịch sử Chiến tranh và Văn hóa 3 ngày", 6440000.0m, "Ngày 1: Đến Buôn Ma Thuột, nhận phòng. Chiều: Thăm Bảo tàng Chiến thắng Buôn Ma Thuột. Tối: Tự do. Ngày 2: Thăm một số di tích lịch sử (nếu có) hoặc thăm buôn làng gần đó để tìm hiểu về ảnh hưởng của chiến tranh. Ngày 3: Thư giãn, mua sắm, ra sân bay.", "Tìm hiểu về lịch sử và các di tích chiến tranh tại Tây Nguyên.", new DateTime(2023, 6, 10, 10, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR091", "CATE001", new DateTime(2022, 12, 15, 11, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm tại thành phố biển Vũng Tàu. Thư giãn tại bãi biển (Bãi Trước, Bãi Sau). Thăm Tượng Chúa Kitô Vua trên đỉnh núi Nhỏ, Hải đăng Vũng Tàu, Bạch Dinh, Chùa Thích Ca Phật Đài. Thưởng thức hải sản tươi ngon. Tour phù hợp cho gia đình và nhóm bạn muốn có chuyến đi biển ngắn ngày gần TP. Hồ Chí Minh.", "3N2D", "LOC019", 40, "Vũng Tàu: Biển và Các Điểm tham quan 3 ngày", 5750000.0m, "Ngày 1: Đến Vũng Tàu, nhận phòng, tắm biển Bãi Sau. Tối: Dạo Bãi Trước. Ngày 2: Sáng leo Tượng Chúa Kitô Vua. Chiều: Thăm Hải đăng Vũng Tàu, Bạch Dinh. Tối: Thưởng thức hải sản. Ngày 3: Thăm Chùa Thích Ca Phật Đài, mua sắm, về lại.", "Tận hưởng biển và khám phá các điểm nổi bật Vũng Tàu.", new DateTime(2022, 12, 15, 11, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR092", "CATE004", new DateTime(2023, 4, 18, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm tập trung vào nghỉ dưỡng và vui chơi tại Vũng Tàu. Lưu trú tại các resort ven biển, tận hưởng tiện ích hồ bơi, bãi biển riêng. Tham gia các hoạt động giải trí tại Hồ Mây Park (trên núi Lớn) với khu vui chơi, công viên động vật. Tour phù hợp cho gia đình có trẻ nhỏ hoặc những người muốn kết hợp thư giãn và giải trí.", "3N2D", "LOC019", 25, "Vũng Tàu: Nghỉ dưỡng Resort và Vui chơi 3 ngày", 9200000.0m, "Ngày 1: Đến Vũng Tàu, nhận phòng resort, thư giãn/tắm biển. Ngày 2: Cả ngày vui chơi tại Hồ Mây Park (lên bằng cáp treo). Tối: Tự do. Ngày 3: Thư giãn buổi sáng tại resort, check-out, mua sắm, về lại.", "Thư giãn tại resort và các khu vui chơi Vũng Tàu.", new DateTime(2023, 4, 18, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR093", "CATE005", new DateTime(2024, 3, 25, 10, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm kết hợp trải nghiệm ẩm thực hải sản và tìm hiểu lịch sử của Vũng Tàu. Khám phá các khu chợ hải sản, nhà hàng địa phương để thưởng thức các món ăn tươi ngon. Thăm các di tích lịch sử như Bạch Dinh (Dinh Toàn quyền Đông Dương cũ), Bảo tàng tỉnh Bà Rịa - Vũng Tàu, Tượng đài Chiến thắng (nếu có). Tour kết hợp ẩm thực, lịch sử và văn hóa.", "3N2D", "LOC019", 20, "Vũng Tàu: Tour Ẩm thực Hải sản và Lịch sử 3 ngày", 6440000.0m, "Ngày 1: Đến Vũng Tàu, nhận phòng. Chiều/Tối: Khám phá ẩm thực hải sản Vũng Tàu. Ngày 2: Thăm Bạch Dinh, Bảo tàng tỉnh (tùy chọn), Tượng đài Chiến thắng. Chiều: Thư giãn/tắm biển. Ngày 3: Thăm chợ Vũng Tàu mua sắm hải sản/đặc sản, về lại.", "Thưởng thức hải sản và tìm hiểu lịch sử Vũng Tàu.", new DateTime(2024, 3, 25, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR094", "CATE014", new DateTime(2023, 11, 28, 14, 0, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm nghỉ dưỡng tại các resort hoặc villa biển cao cấp tại Vũng Tàu hoặc khu vực lân cận (như Hồ Tràm). Tận hưởng không gian riêng tư, dịch vụ hoàn hảo, hồ bơi riêng, spa, và các tiện ích sang trọng khác. Tour tập trung vào sự thư giãn tuyệt đối và trải nghiệm nghỉ dưỡng đẳng cấp bên bờ biển.", "4N3D", "LOC019", 10, "Vũng Tàu: Tour 4 ngày Nghỉ dưỡng Cao cấp", 27600000.0m, "Ngày 1: Đến Vũng Tàu/Hồ Tràm, di chuyển đến resort, nhận phòng, thư giãn. Ngày 2: Tự do tận hưởng tiện ích resort (hồ bơi, bãi biển riêng, spa). Ngày 3: Tự do hoặc tham gia hoạt động nhẹ nhàng của resort (yoga, gym). Ngày 4: Thư giãn buổi sáng, check-out, về lại.", "Trải nghiệm kỳ nghỉ sang trọng tại các khu nghỉ dưỡng Vũng Tàu.", new DateTime(2023, 11, 28, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR095", "CATE007", new DateTime(2024, 1, 15, 8, 30, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm kết hợp thăm các điểm tâm linh nổi tiếng của Vũng Tàu và ngắm nhìn cảnh quan biển núi. Thăm Tượng Chúa Kitô Vua, Chùa Thích Ca Phật Đài, Niết Bàn Tịnh Xá, Chùa Quan Âm. Leo núi Nhỏ hoặc núi Lớn để ngắm cảnh toàn thành phố và biển. Tour phù hợp với những người muốn kết hợp du lịch tâm linh và ngắm cảnh thiên nhiên.", "3N2D", "LOC019", 30, "Vũng Tàu: Tour Tâm linh và Cảnh quan 3 ngày", 5980000.0m, "Ngày 1: Đến Vũng Tàu, nhận phòng. Chiều: Thăm Tượng Chúa Kitô Vua. Tối: Dạo Bãi Trước. Ngày 2: Thăm Chùa Thích Ca Phật Đài, Niết Bàn Tịnh Xá, Chùa Quan Âm. Buổi chiều: Thư giãn/tắm biển. Ngày 3: Leo Hải đăng Vũng Tàu, mua sắm, về lại.", "Khám phá các điểm tâm linh và cảnh đẹp thiên nhiên Vũng Tàu.", new DateTime(2024, 1, 15, 8, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR096", "CATE016", new DateTime(2023, 8, 28, 10, 0, 0, 0, DateTimeKind.Unspecified), "Hành trình 3 ngày 2 đêm tại Côn Đảo, tìm hiểu về lịch sử bi tráng của nơi đây. Thăm hệ thống nhà tù Côn Đảo, Bảo tàng Côn Đảo, Dinh Chúa Đảo. Viếng Nghĩa trang Hàng Dương và mộ Cô Sáu (Võ Thị Sáu). Tour mang tính giáo dục và tâm linh sâu sắc. Bao gồm vé tham quan các di tích chính.", "3N2D", "LOC020", 25, "Côn Đảo: Hành trình Lịch sử và Tâm linh 3 ngày", 11500000.0m, "Ngày 1: Đến Côn Đảo, nhận phòng. Chiều: Thăm Dinh Chúa Đảo, trại tù Phú Hải, Phú Sơn. Tối: Tự do/thăm Nghĩa trang Hàng Dương. Ngày 2: Sáng sớm viếng mộ Cô Sáu (nếu muốn). Thăm trại tù Chuồng Cọp kiểu Pháp/Mỹ. Chiều: Thăm Bảo tàng Côn Đảo. Ngày 3: Thư giãn/mua sắm đặc sản, ra sân bay.", "Tìm hiểu về quá khứ và viếng thăm các di tích Côn Đảo.", new DateTime(2023, 8, 28, 10, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR097", "CATE006", new DateTime(2024, 4, 10, 9, 0, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm khám phá vẻ đẹp sinh thái của Côn Đảo. Trekking nhẹ trong Vườn quốc gia Côn Đảo để khám phá rừng nguyên sinh. Đi thuyền tham quan các đảo nhỏ như Hòn Bảy Cạnh (khu bảo tồn rùa biển, nếu vào mùa sinh sản có thể xem rùa đẻ trứng/thả rùa con), Hòn Tre. Lặn ngắm san hô tại các rạn san hô đẹp. Tour phù hợp cho người yêu thiên nhiên và môi trường.", "4N3D", "LOC020", 20, "Côn Đảo: Sinh thái Biển, Rừng và Rùa biển 4 ngày", 18400000.0m, "Ngày 1: Đến Côn Đảo, nhận phòng. Chiều: Thư giãn/tắm biển bãi An Hải. Tối: Tự do. Ngày 2: Trekking Vườn quốc gia Côn Đảo (đường Mũi Chim Chim hoặc Bãi Ông Đụng). Ngày 3: Đi thuyền tham quan Hòn Bảy Cạnh (thăm trạm kiểm lâm, xem rùa - tùy mùa), lặn ngắm san hô. Ngày 4: Thư giãn, mua sắm đặc sản, ra sân bay.", "Khám phá thiên nhiên hoang sơ và đa dạng sinh học Côn Đảo.", new DateTime(2024, 4, 10, 9, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR098", "CATE014", new DateTime(2023, 12, 20, 14, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm nghỉ dưỡng tại các resort 5 sao biệt lập trên Côn Đảo. Tận hưởng không gian sang trọng, yên bình, bãi biển riêng tuyệt đẹp và dịch vụ hoàn hảo. Các bữa ăn tinh tế, spa cao cấp, và các hoạt động thư giãn. Phù hợp cho cặp đôi hoặc những người tìm kiếm một kỳ nghỉ xa hoa và tách biệt khỏi thế giới bên ngoài.", "3N2D", "LOC020", 8, "Côn Đảo: Nghỉ dưỡng Sang trọng tại Đảo 3 ngày", 64400000.0m, "Ngày 1: Đến Côn Đảo, di chuyển đến resort, nhận phòng, thư giãn. Ngày 2: Tự do tận hưởng tiện ích resort (hồ bơi, bãi biển riêng, spa, ẩm thực). Ngày 3: Thư giãn buổi sáng, check-out, ra sân bay.", "Trải nghiệm kỳ nghỉ đẳng cấp và riêng tư tại Côn Đảo.", new DateTime(2023, 12, 20, 14, 0, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR099", "CATE008", new DateTime(2024, 5, 1, 9, 30, 0, 0, DateTimeKind.Unspecified), "Tour 4 ngày 3 đêm dành cho những người yêu thích lặn biển và khám phá các hòn đảo nhỏ xung quanh Côn Đảo. Tham gia các buổi lặn (scuba diving hoặc snorkeling) tại các điểm có rạn san hô đẹp và đa dạng sinh vật biển. Đi thuyền khám phá Hòn Tài, Hòn Cau, Hòn Tre (nếu có thời gian), tìm hiểu về hệ sinh thái biển. Tour yêu cầu chứng chỉ lặn (cho scuba) hoặc phù hợp với người bơi tốt (snorkeling). Bao gồm thiết bị lặn và hướng dẫn viên.", "4N3D", "LOC020", 15, "Côn Đảo: Lặn biển và Khám phá Đảo nhỏ 4 ngày", 27600000.0m, "Ngày 1: Đến Côn Đảo, nhận phòng. Chiều: Chuẩn bị và làm quen (hoặc lặn buổi chiều). Tối: Tự do. Ngày 2: Đi thuyền ra các điểm lặn (Hòn Bảy Cạnh, Hòn Tài...), lặn/snorkeling. Ngày 3: Tiếp tục lặn/snorkeling tại các điểm khác hoặc thăm đảo nhỏ. Ngày 4: Thư giãn, mua sắm, ra sân bay.", "Khám phá thế giới dưới nước và các hòn đảo hoang sơ Côn Đảo.", new DateTime(2024, 5, 1, 9, 30, 0, 0, DateTimeKind.Unspecified) },
                    { "TOUR100", "CATE020", new DateTime(2023, 7, 28, 14, 0, 0, 0, DateTimeKind.Unspecified), "Tour 3 ngày 2 đêm tập trung vào du lịch sức khỏe và tinh thần tại Côn Đảo yên bình. Tham gia các buổi tập yoga, thiền định tại những địa điểm có khung cảnh thiên nhiên đẹp (ven biển, trên đồi). Thưởng thức ẩm thực lành mạnh, các liệu pháp spa thư giãn. Dành thời gian tản bộ trong rừng, bơi lội trong không gian tĩnh lặng. Tour phù hợp cho những người muốn tái tạo năng lượng và tìm kiếm sự bình yên.", "3N2D", "LOC020", 10, "Côn Đảo: Du lịch Sức khỏe và Thiền định 3 ngày", 21850000.0m, "Ngày 1: Đến Côn Đảo, nhận phòng. Chiều: Buổi tập yoga/thiền đầu tiên. Tối: Ăn tối lành mạnh, thư giãn. Ngày 2: Buổi sáng tập yoga/thiền. Buổi chiều: Tản bộ trong rừng hoặc bơi lội, spa (tùy chọn). Tối: Thiền định/nghỉ ngơi sớm. Ngày 3: Buổi tập cuối, ăn sáng, check-out, ra sân bay.", "Tìm kiếm sự bình yên và cân bằng tại Côn Đảo.", new DateTime(2023, 7, 28, 14, 0, 0, 0, DateTimeKind.Unspecified) }
                });

